/******** CREATE TABLES TO POPULATE ********/

CREATE TABLE [Students] (
  [StudentID] [INT] IDENTITY(10000000, 1) NOT NULL,
  [StudentFName] [VARCHAR](50) NULL,
  [StudentLName] [VARCHAR](50) NULL,
  PRIMARY KEY ([StudentID])
)
GO

CREATE TABLE [SubTerms] (
  [SubTermID] VARCHAR(10) NOT NULL,
  [SubTermTitle] VARCHAR(50) NULL,
  PRIMARY KEY ([SubTermID])
)
GO

CREATE TABLE [Terms] (
  [TermID] [INT] IDENTITY (200, 10) NOT NULL,
  [Year] [INT] NULL,
  [Semester] [VARCHAR](10) NULL,
  PRIMARY KEY ([TermID])
)
GO

CREATE TABLE [Universities] (
  [UniversityID] [INT] IDENTITY (11, 10) NOT NULL,
  [UniversityName] VARCHAR(50) NULL,
  PRIMARY KEY ([UniversityID])
)
GO

CREATE TABLE [CampusBuildings] (
  [BuildingID] [VARCHAR](10)NOT NULL,
  [BuildingName] [VARCHAR](30) NOT NULL,
  [CampusName] [VARCHAR](20) NOT NULL,
  [UniversityID] [INT] NOT NULL,
  PRIMARY KEY ([BuildingID]),
  CONSTRAINT [FK_CampusBuildings.UniversityID]
    FOREIGN KEY ([UniversityID])
      REFERENCES [Universities]([UniversityID])
)
GO

CREATE TABLE [Locations] (
  [LocationID] [INT] IDENTITY(1000,10) NOT NULL,
  [BuildingID] [VARCHAR](10) NOT NULL,
  [RoomNum] [VARCHAR](10) NOT NULL,
  PRIMARY KEY ([LocationID]),
  CONSTRAINT [FK_Locations.BuildingID]
    FOREIGN KEY ([BuildingID])
      REFERENCES [CampusBuildings]([BuildingID])
)
GO

CREATE TABLE [Instructors] (
  [InstructorID] [INT] IDENTITY(20000, 10) NOT NULL,
   [InstructorFullName] [VARCHAR](50) NULL,
  [InstructorFName] [VARCHAR](50) NULL,
  [InstructorLName] [VARCHAR](50) NULL
  PRIMARY KEY ([InstructorID])
)
GO

CREATE TABLE [Subjects] (
  [SubjectID] [VARCHAR](4) NOT NULL,
  [SubjectName] [VARCHAR](50) NULL,
  PRIMARY KEY ([SubjectID])
)
GO

CREATE TABLE [CourseCatalog] (
  [CourseCatID] [INT] IDENTITY(50000, 10) NOT NULL,
  [SubjectID] [VARCHAR](4) NOT NULL,
  [CourseNum] [VARCHAR](50) NOT NULL,
  [CourseTitle] [VARCHAR](150) NULL,
  [Level] [VARCHAR](5) NOT NULL,
  [CreditHours] [INT] NULL,
  [CourseDesc] [VARCHAR](1000) NULL,
  PRIMARY KEY ([CourseCatID]),
  CONSTRAINT [FK_CourseCatalog.SubjectID]
    FOREIGN KEY ([SubjectID])
      REFERENCES [Subjects]([SubjectID])
)
GO

CREATE TABLE [Courses] (
  [CourseID] [INT] IDENTITY(30000, 100) NOT NULL,
  [CourseCatID] [INT] NULL,
  [CRN] [INT] NULL,
  [InstructorID] [INT] NULL,
  [LocationID] [INT] NULL,
  [TermID] [INT] NULL,
  [SubTermID] [VARCHAR](10) NULL,
  [SectionNum] [VARCHAR](10) NULL,
  [MeetingTime] [VARCHAR](50) NULL,
  [MeetingDays] [VARCHAR](50) NULL,
  PRIMARY KEY ([CourseID]),
  CONSTRAINT [FK_Courses.LocationID]
    FOREIGN KEY ([LocationID])
      REFERENCES [Locations]([LocationID]),
  CONSTRAINT [FK_Courses.SubTermID]
    FOREIGN KEY ([SubTermID])
      REFERENCES [SubTerms]([SubTermID]),
  CONSTRAINT [FK_Courses.TermID]
    FOREIGN KEY ([TermID])
      REFERENCES [Terms]([TermID]),
  CONSTRAINT [FK_Courses.InstructorID]
    FOREIGN KEY ([InstructorID])
      REFERENCES [Instructors]([InstructorID]),
  CONSTRAINT [FK_Courses.CourseCatID]
    FOREIGN KEY ([CourseCatID])
      REFERENCES [CourseCatalog]([CourseCatID])
)
GO

CREATE TABLE [Majors] (
  [MajorID] [INT] IDENTITY(50, 10) NOT NULL,
  [MajorName] VARCHAR(50) NULL,
  PRIMARY KEY ([MajorID])
)
GO

CREATE TABLE [Minors] (
  [MinorID] [INT] IDENTITY(5, 10) NOT NULL,
  [MinorName] VARCHAR(50) NULL,
  PRIMARY KEY ([MinorID])
)
GO

CREATE TABLE [StudentMajors] (
  [StudentMajorID] [INT] IDENTITY(4000, 10) NOT NULL,
  [StudentID] [INT] NOT NULL,
  [MajorID] [INT] NOT NULL,
  [StartDate] [DATE] DEFAULT GETDATE ()NULL,
  [EndDate] [DATE] NULL,
  PRIMARY KEY ([StudentMajorID]),
  CONSTRAINT [FK_StudentMajors.MajorID]
    FOREIGN KEY ([MajorID])
      REFERENCES [Majors]([MajorID]),
  CONSTRAINT [FK_StudentMajors.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID])
)
GO

CREATE TABLE [StudentMinors] (
  [StudentMinorID] [INT] IDENTITY(4005, 5) NOT NULL,
  [StudentID] [INT] NOT NULL,
  [MinorID] [INT] NOT NULL,
  [StartDate] [DATE] DEFAULT GETDATE ()NULL,
  [EndDate] [DATE] NULL,
  PRIMARY KEY ([StudentMinorID]),
  CONSTRAINT [FK_StudentMinors.MinorID]
    FOREIGN KEY ([MinorID])
      REFERENCES [Minors]([MinorID]),
  CONSTRAINT [FK_StudentMinors.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID])
)

CREATE TABLE [StudentAdvisors] (
  [StudentAdvisorID] [INT] IDENTITY(1000, 5) NOT NULL,
  [StudentID] [INT] NOT NULL,
  [InstructorID] [INT] NOT NULL,
  [StartDate] [DATE] DEFAULT GETDATE () NOT NULL,
  [EndDate] [DATE] NULL,
  PRIMARY KEY ([StudentAdvisorID]),
  CONSTRAINT [FK_StudentAdvisors.InstructorID]
    FOREIGN KEY ([InstructorID])
      REFERENCES [Instructors]([InstructorID]),
  CONSTRAINT [FK_StudentAdvisors.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID])
)
GO

CREATE TABLE [GradeScale] (
  [Grade] [VARCHAR](2) NOT NULL,
  [GradeWeight] [DECIMAL](3,2),
  PRIMARY KEY ([Grade])
)
GO


CREATE TABLE [TranscriptLineItems] (
  [TranscriptLineItemID] [INT] IDENTITY(100, 1) NOT NULL,
  [CourseID] [INT] NOT NULL,
  [StudentID] [INT] NOT NULL,
  [Grade] [VARCHAR](2),
  PRIMARY KEY ([TranscriptLineItemID]),
  CONSTRAINT [FK_TranscriptLineItems.CourseID]
    FOREIGN KEY ([CourseID])
      REFERENCES [Courses]([CourseID]),
  CONSTRAINT [FK_TranscriptLineItems.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID]),
  CONSTRAINT [FK_TranscriptLineItems.Grade]
	FOREIGN KEY ([Grade])
	  REFERENCES [GradeScale]([Grade])
	  )
GO


