/***** CourseCatalog *****/
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B225', 'Fundamentals of Accounting I', 'UG', 3, 'External financial reporting for business entities,  including income measurement and determination of financial position.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B226', 'Fundamentals of Accounting II', 'UG', 3, 'Internal managerial and cost accounting,  including budgeting,  cost determination and analysis.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B325', 'Fraud Examination', 'UG', 3, 'An overview of the different types of fraud,  how and why they are committed,  and the methodology for investigating and resolving allegations of fraud. Special emphasis is placed on detection and deterrence.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B335', 'Survey of Federal Taxation', 'UG', 3, 'Federal tax law and preparation of individual income tax returns.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B345', 'Accounting Information Systems', 'UG', 3, 'Accounting systems for business decision-making and effective control of the business enterprise.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B355', 'Cost Accounting', 'UG', 3, '(Prereq: ACCT B226) Preparation,  critical analysis and use of management accounting information for purposes of strategic decision making,  planning and control and performance measurement and evaluation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B425', 'Intermediate Accounting I', 'UG', 3, 'A detailed study of the preparation and presentation of the balance sheet,  income statement,  statement of retained earnings,  and statement of cash flows. Includes a comprehensive analysis of financial transactions related to revenues and assets,  with an emphasis on revenue recogition,  and asset valuation issues.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B426', 'Intermediate Accounting II', 'UG', 3, 'A continuation of the detailed study of the preparation and presentation of financial statements. Problem solving techniques and the ability to structure problem solutions will be stressed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B429', 'Internship in Accounting', 'UG', 2, 'Experiential learning in a public or private accounting setting. This course may be repeated once with the approval of the Department Chair and permission of the Instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B437', 'Advanced Accounting', 'UG', 3, '(Prerequisite: a grade of C or better in ACCT B426) The detailed study of special advanced topics of accounting,  including (1) accounting for business mergers and consolidations,  subsequent activities and consolidated reporting of financial information,   (2) tax topics for business combinations,  (3) relevant International Financial Reporting Standards,  (4) accounting for legal reorganizations and liquidations,  and (5) accounting for partnership formations,  operations,  and terminations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ACCT', 'B485', 'Auditing', 'UG', 3, 'Principles of auditing necessary to evaluate the integrity of accounting systems and financial reporting.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('AFAM', 'B201', 'Introduction to African-American Studies I', 'UG', 3, 'A broad introduction to the history,  culture,  religion,  institutions,  politics,  economics,  arts,  and psychology of people of African descent as developed from experience in both the old and new worlds.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('AFAM', 'B202', 'Introduction to African-American Studies II', 'UG', 3, NULL);
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B101', 'Primates,  People and Prehistory', 'UG', 3, 'An exploration of human origins,  human evolution,  human prehistory and cultural existence from its less complex forms to early civilizations. An introduction to the concepts,  methods and data of physical,  biological and archaeological anthropology. May be taken with,  or independently of,  ANTH 102.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B102', 'Understanding Other Cultures', 'UG', 3, 'An exploration and comparison of selected contemporary cultures,  including their languages. An introduction to the concepts,  methods and data of socio-cultural anthropology and anthropological linguistics. May be taken with,  or independently of,  ANTH B101.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B301', NULL, 'UG', NULL, 'Comparative study of selected Latin American cultures with emphasis on their significance for a broader anthropological theory.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B302', NULL, 'UG', NULL, 'Application of techniques and insights of social and cultural anthropology to selected cultural settings in contemporary U.S.A.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B312', 'Contemporary Cross-Cultural Analysis', 'UG', 3, 'An examination of conformity,  conflict or stability,  of human interactions across cultural boundaries both at home and abroad,  the positive and negative consequences of increasing global interconnectedness and the role of culture change,  ethnic identity or religious unity in creating contradictory social and political trends.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B317', 'North American Indian Cultures', 'UG', NULL, 'Comparative study of ethnographic data on American Indian cultures,  with emphasis on their significance for ethnological theory.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B319', 'Principles of Archaeology', 'UG', 3, 'An introducation to the principles,  methods,  and theory of archaelogy,  including prehistroic and historic case studies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B333', 'North American Prehistory', 'UG', 3, 'Prehistroic anthropology in North America from the first arrival of man though the beginning of European acculturation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ANTH', 'B344', 'Anthropology of Tourism', 'UG', 3, 'Drawing on tourism destinations,  development agendas,  and societies from around the globe,  this course will critically examine the relationship between tourism and cultural identities and economies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
