 ('BADM', 'B101', 'Contemporary Business', 'UG', 3, 'The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management,  marketing,  finance and accounting will be integrated the course. A topical survey of business issues and challenges.');
