 ('BADM', 'B310', 'Health Economics', 'UG', NULL, '(Prerequisite: ECON B221 or ECON B222 or PUBH B380) This course will help students develop the understanding of demand and supply side factors related to health care so they can apply economic principles to various aspects of health,  health systems and health care.');
