INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BADM', 'B380', 'Entrepreneurship', 'UG', 3, 'This course is an overall introduction to the nature and scope of entrepreneurship. The entrepreneurial process as well as the entrepreneurial profile is examined in detail. It includes the planning,  financing,  launching and harvesting of a new venture. Entrepreneurial strategies are discussed for all facets of the business including franchising,  growth and international aspects. Application of entrepreneurship to large corporations,  i.e. entrepreneurship,  is also a part of the course.');
