 ('BADM', 'B383', 'International Business', 'UG', 3, 'Introduces the student to economic,  financial,  legal,  political,  cultural,  institutional and managerial considerations associated with international business transactions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BADM', 'B396', 'Business Research Methods', 'UG', 3, 'Focus is on the acquisition,  use and evaluation of information from a managers perspective. The course will include problem diagnosis,  research design,  questionnaire preparation,  sampling plans and the collection,  analysis and interpretation of data as an aid to effective and efficient managerial decisions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BADM', 'B397', 'Topics in Business', 'UG', NULL, 'Study of varied business areas and issues that are not covered in existing course offerings. Course may be taken twice with different topics for a maximum of 6 credit hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BADM', 'B399', 'Independent Study in Business', 'UG', 3, '(Prereq: Junior standing and an approved contract with instructor) Independent study courses are designed primarily for juniors and seniors who desire advanced intensive work on specific topics. Independent studies are not intended to substitute for courses listed in the USCB Bulletin. The maximum number of independent study hours a student may earn in business is limited to six. Contract approval by instructor and department chair is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BADM', 'B429', 'Internship in Business', 'UG', 3, '(Prereq: Junior standing,  2.5 GPA,  BMKT 350,  BBAD 345 and an approved contract with the Internship Coordinator) This course provides students in all disciplines with the opportunity to reinforce classroom learning by working in their discipline in a supervised business environment. This course may be repeated with the approval of the Department Chair and the students academic advisor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B100H', 'Biology Honors Seminar', 'UG', 1, 'This seminar will an introduction to topics,  information,  reading and class field trips to reflect the honor''s experience in the first two years of the program.  Topics covered will include common readings,  discussion of current research topics or current events,  and professional development of the student.  Course can be taken for credit up to four semesters.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B101', 'Biological Principles I', 'UG', 4, 'Introductory survey of cell structure and function,  genetics and evolution. For biology majors,  premed students and others needing a prerequisite in biological sciences. Three lecture hours and three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B102', 'Biological Principles II', 'UG', 4, 'Introductory survey of plant and animal systems,  principles of development,  physiology,  reproduction and ecology. Three lecture hours and three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B110', 'General Biology', 'UG', 4, 'Basic biological concepts and issues for non-biology majors. Three lecture,  two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B120', 'Human Biology', 'UG', 3, 'Fundamental principles of human biology. Three lecture hours per week. Not for major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B120L', 'Human Biology Laboratory', 'UG', 1, 'Exercises dealing with basic concepts of human biology. Not for major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B200', 'Plant Science', 'UG', 3, 'An introduction to plant science for the non-major. This course does not carry major credit and is not designed as a prerequisite for other biology courses. Plant development,  physiology,  genetics,  evolution and ecology will be considered. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B200L', 'Plant Science Laboratory', 'UG', 1, 'Laboratory exercises,  demonstrations and audiovisual supplements to BBIO 200. Two hours per week. Not for major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B230', 'Microbiology', 'UG', 4, '(Prerequisite: college-[Level] biology) An introduction to bacteria and viruses,  emphasizing structure,  metabolism and pathogenesis. Discussion of infectious diseases,  antigen-antibody relationships and anti-microbial agents in chemotherapy. Not available for biology major credit. Three lecture and three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B232', 'Human Anatomy', 'UG', 4, 'Functional anatomy of the human body and its relation to disease processes. Not for biology major credit. Three lecture and three laboratory hours per week');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B234', 'Human Physiology', 'UG', 4, 'Physiology of the human body,  including Nervous,  sensory,  endocrine,  muscle,  circulatory,  immune,  respiratory,  digestive,  urinary and reproductive systems. Not available for biology majors credit. 3 lecture and 2 laboratory hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B243', 'Human Anatomy and Physiology', 'UG', 4, '(Prerequisite: 1 year of high school (or higher) biology or chemistry with laboratory with a grade of B or better and BMTH 111L or placement BMTH 111 or higher.) Functional anatomy and physiology of the human body,  including the integumentary,  skeletal,  muscular and nervous systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B244', 'Human Anatomy and Physiology II', 'UG', 4, 'Functional anatomy and physiology of the human body,  including the cardiovascular,  endocrine,  excretory,  reproductive,  digestive and respiratory systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B270', 'Introduction to Environmental Biology', 'UG', 3, 'Basic ecological principles and the impacts of human population growth and technology. Not for major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B270L', 'Introduction to Environmental Biology Laboratory', 'UG', 1, 'Demonstrations,  data analyses,  discussions and films relating to human ecology,  resource use and environmental impact. Two hours per week. Not for major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B271', 'Applied Enviromental Science', 'UG', 3, 'Basic ecological principles on the functions and values of natural systems and how to apply those principles to designing the built environment in concert with nature.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B290', 'Weekly Seminar in Science', 'UG', 1, '(Prerequisite: Permission of instructor) Weekly seminar in science is a survey of scientific research seminars presented by both USCB researchers and visiting researchers from other institutions.  Format is that of a departmental seminar.  Grades are based on attendance and on a number of executive summaries of seminars by students taking the course for credit.  Class can be taken up to 4 times under different semesters.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B295', 'Directed Studies in Biology', 'UG', 3, 'Study of a topic not otherwise available to student. May involve reading assignments,  tutorial,  lectures,  papers,  presentations,  or field or laboratory study,  determined in consultation with instructor. Repeatable to a maximum of 6 credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B301', 'Ecology and Evolution', 'UG', 3, 'Concepts of evolution,  populations and population interactions; communities and ecosystems. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B301L', 'Ecology and Evolution Laboratory', 'UG', 1, 'Experiments,  exercises and demonstrations. Three hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B302', 'Cell and Molecular Biology', 'UG', 3, 'Principles of eukaryotic cell structure,  molecular organization and physiology. Genome organization and expression. Cell growth,  division and cell-cell interactions. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B302L', 'Cell and Molecular Biology Laboratory', 'UG', 1, 'Experiments,  exercises and demonstrations. Three hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B303', 'Fundamental Genetics', 'UG', 3, 'Basic principles of transmission and molecular genetics; quantitative inheritance; recombination; biochemical aspects of gene function and regulation; developmental genetics and population genetics. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B395', 'Advanced Directed Studies in Biology', 'UG', NULL, 'Study of a topic not otherwise available to student. May involve reading assignments,  tutorial,  lectures,  papers,  presentations,  or field or laboratory study,  determined in consultation with instructor. Repeatable to a maximum of 6 credit hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B399', 'Independent Study in Biology', 'UG', NULL, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for academic affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B401', 'Marine Internship', 'UG', 0, '(Prerequisite: Sophomore standing) Required paid or unpaid internship or field experience for gaining practical experience in marine biology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B405', 'Developmental Biology I', 'UG', 3, 'An introduction to the descriptive and experimental embryology of animals. Living and preserved specimens will be used to demonstrate the basic processes of embryogenesis. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B405L', 'Developmental Biology I Laboratory', 'UG', 1, 'Descriptive and experimental exercises related to embryology. One three-hour laboratory per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B410', 'Invertebrate Zoology', 'UG', 4, 'Phylogenetic and comparative aspects of anatomy,  physiology,  reproduction and embryology of the invertebrates. Three lecture and one three-hour laboratory per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B411', 'Biology of Marine Organisms', 'UG', 4, '(Prereq: BBIO 101,  BBIO 102) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B425', 'Marine Plants', 'UG', NULL, 'Diversity,  distribution,  physiology,  ecology,  evolution,  and economic importance of marine algal,  sea grass and mangrove communities. Three lecture and three laboratory hours per week. Scheduled field trips are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B430', 'Histology', 'UG', NULL, 'An introduction to the tissues that make up the human body. The microscopic anatomy of tissues is examined and discussed in terms of function and physiology. Three lecture hours and four laboratory hours per week.');
