INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B431', 'Bacteriology', 'UG', 3, 'Introduction to bacteria and viruses emphasizing ultra structure,  physiology,  genetics and growth. Discussion of public health,  industrial and environmental microbiology.  Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B431L', 'Bacteriology Laboratory', 'UG', 1, 'Three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B435', 'Neurobiology', 'UG', 3, 'Descriptive and experimental aspects of the neural basis of behavior,  emphasizing cellular and molecular mechanisms. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B435L', 'Neurobiology', 'UG', 1, 'Descriptive and experimental aspects of the neural basis of behavior,  emphasizing cellular and molecular mechanisms.  One 3-hour laboratory per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B436', 'Ichthyology', 'UG', 4, 'Phylogeny,  morphology,  behavior,  and ecology of fishes. Three lecture and three laboratory hours per week. Several field trips are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B438', 'Marine Mammal Biology', 'UG', NULL, '(Prerequisite: BIOL B301) Diversity,  anatomy,  ecology,  energetics,  and conservation of marine mammals.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B438L', 'Marine Mammal Biology Lab', 'UG', NULL, '(Prerequisite: BIOL B301; Corequisite: BIOL B438) Experimental aspects of marine mammal biology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B441', 'Principles of Biochemistry', 'UG', 3, '{=CHEM B450}  A survey of fundamentals of biochemistry.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B441L', 'Principles of Biochemistry Laboratory', 'MS', 1, '{=CHEM B450L}Three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B448', 'Life and Death in the Salt Marsh', 'UG', 4, 'Intensive Maymester course teaching field research methods,  statistical design,  and culminating in an independent research project on aspects of ecological processes of Beaufort and surrounding counties.  Students will spend more than 5 hours per day in classroom/field-laboratory context planning,  developing,  researching background,  and carrying out their research project,  approved and facilitated by course faculty.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B450', 'Biological Oceanography', 'UG', 4, '(Prerequisite: C or better in two of the three core courses: BIOL B301,  B302,  B303) Capstone course for the Marine Biology degree program that is an interdisciplinary introduction to biological oceanography. The course integrates physical,  chemical,  geological and biological principles an overview of oceanic processes,  with an emphasis on the influence of organisms on biogeochemical cycles. 3-50 minute lectures and 2.8-hour laboratory each week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B451', 'Forensic Techniques and Data Analysis', 'UG', 3, 'Current application of forensic data collection,  analysis and interpretation in the legal process. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B460', 'General Physiology', 'UG', 3, 'Functional mechanisms of vertebrate organ systems. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B460L', 'General Physiology Laboratory', 'UG', 1, 'Experiments on vertebrate organ system functions using different animal models. One four-hour laboratory per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B461', 'Medical Parasitology', 'UG', 3, 'The goal of this course is to introduce students to phylogenetic/taxonomic overview of the major groups of parasites with emphasis on parasites that are of medical or veterinary importance.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B461L', 'Medical Parasitology Laboratory', 'UG', 1, 'The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites and develop laboratory skills in parasite identification and morphology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B470', 'Principles of Ecology', 'UG', NULL, 'Interactions of organisms and the environment; ecosystem structure and functions. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B470L', 'Principles of Ecology Laboratory', 'UG', NULL, 'Three lab hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B471', 'Conservation Biology', 'UG', 4, 'Synthesis of current scientific trends in conservation biology. Emphasis will be placed on the preservation of biological diversity as well as its evolutionary potential. Laboratory/Seminar will review scientific literature and introduce modern molecular techniques in conservation biology and computer simulation modeling.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B475', 'Marine Ecology', 'UG', 3, 'Structure,  dynamics and interactions between populations and communities in marine ecosystems. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B475L', 'Marine Ecology Laboratory', 'UG', 1, 'Laboratory and field exercises in coastal environments.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B476', 'Freshwater Biology', 'UG', NULL, '(Prerequisite: BIOL B301 & B301L) This course provides an introduction to freshwater biology,  with an emphasis on blackwater swamps,  temperate and subtropical zone lakes,  ponds and streams including species,  populations,  and communities that occupy these  environments.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B478', 'Herpetology', 'UG', 4, 'Evolution,  physiology,  ecology and behavior of amphibians and reptiles. The lab portion of this course will focus on native amphibians and reptiles and their importance in local ecosystems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B480', 'Molecular Marine Ecology', 'UG', 3, 'Investigation of techniques and analysis of molecular data in marine organisms. Hands-on experience using molecular tools to investigate population genetic,  ecological and systematic principles.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B490', 'Marine Policy', 'UG', 3, '(Prerequisite: C or better in two of the three core courses BIOL B301,  B302,  and B303) This course is an overview of strategies and current practices in marine and coastal policy and management and will examine relevant historical and current state,  federal and international marine and coastal policy programs and issues.  Students will learn directly from professionals in government,  academia and non-governmental organizations and stakeholders. Specific emphasis will be put on science communication to policymakers in current issues. This course will be heavily activity-based.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B498', 'Biological Research: An Introduction', 'UG', 4, '(Prereq: one 300-[Level] or higher biological laboratory and consent of instructor) Methodologies of biological research with emphasis on hypothesis formation,  research design and data collection and current issues in biology. Two lecture and six laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('BIOL', 'B499', 'Topics in Biology', 'UG', NULL, 'Current developments in biological sciences. Readings and research on selected topics. Course content varies and will be announced in the schedule of classes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B101', 'Fundamental Chemistry', 'UG', NULL, 'A science elective surveying inorganic and solution chemistry. First of a terminal two-semester sequence.Three lecture,  one recitation and two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B102', 'Fundamental Chemistry II', 'UG', NULL, 'An introductory survey of organic and biochemistry. Three lecture,  one recitation and two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B105', 'Chemistry and Modern Man I', 'UG', NULL, 'A conceptual and qualitative approach to chemistry,  its evolution,  achievements and goals and its impact on technology,  the environment and modern life and thought. (Specifically designed for non-science majors.) Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B106', 'Chemistry and Modern Man II', 'UG', NULL, 'A continuation of Chemistry 105. Three lecture hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B106L', 'Chemistry and Modern Man Laboratory', 'UG', NULL, '(Prereq: CHEM B105; Coreq: CHEM B106) Laboratory associated with CHEM 106. Three hours of laboratory per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B109', 'Chemistry of Living Things', 'UG', 4, 'Chemical principles including the structure of and energy associated with matter; quantitative kinetic and equilibrium analysis of chemical and physical processes. Structure and function of biological macromolecules and the molecular basis of inheritance are surveyed. Specifically designed for non-science majors. Cannot receive credit for both CHEM B101 and B109. Three lecture,  one recitation and two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B111', 'General Chemistry I', 'UG', 4, 'A survey of the principles that underlie all chemistry with applications illustrating these principles. Three lecture,  one recitation and two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B112', 'General Chemistry II', 'UG', 4, 'A continuation of CHEM B111. Special emphasis on chemical equilibrium. Three lecture,  one recitation and three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B118', 'Computational Chemistry', 'UG', NULL, 'Introduction to the use of computers in solving chemical problems. One discussion and two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B321', 'Quantitative Analysis', 'UG', 3, 'Gravimetric,  volumetric and introductory instrumental analysis. Three lecture and one recitation hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B321L', 'Quantitative Analysis Laboratory', 'UG', 1, 'Lab associated with CHEM B321. Three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B331L', 'Essentials of Organic Chemistry Laboratory I', 'UG', 1, 'Laboratory safety,  syntheses,  separation and purification of carbon compounds.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B332L', 'Essential of OrganicI Chemistry Laboratory II', 'UG', 1, 'Continuation of BCHM 331L. Spectroscopic identification of carbon compounds. For non-majors. Three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B333', 'Organic Chemistry I', 'UG', 3, 'Contemporary theories,  nomenclature,  reactions,  mechanisms and syntheses of carbon compounds. Three lecture and one recitation hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B333L', 'Comprehensive Organic Chemistory I Laboratory', 'UG', NULL, 'Laboratory safety,  synthesis,  separation and purification of carbon compounds. Required for chemistry majors. Six laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B334', 'Organic Chemistry II', 'UG', 3, 'Continuation of CHEM B333. Required for chemistry majors. Three lecture and one recitation hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B334L', 'Comprehensive Organic Chemistry II Laboratory', 'UG', NULL, 'Continuation of CHEM B333L. Spectroscopic identification of carbon compounds. Required for chemistry majors. Six laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B398', NULL, 'UG', NULL, 'Study of a topic not otherwise available to student.  May involve reading assignments,  tutorial,  lectures,  papers,  presentations,  or field or laboratory study,  determined in consultation with instructor.  Repeatable to a maximum of 8 credit hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B399', 'Indpendent Study in Chemistry', 'UG', 3, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for academic affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B450', 'Principles of Biochemistry', 'UG', 3, 'A survey of fundamentals of biochemistry.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B450L', 'Principles of Biochemistry Laboratory I', 'UG', 1, 'Three laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CHEM', 'B496', 'Undergraduate Research in Chemistry', 'UG', NULL, '(Prereq: consent of instructor) Introduction to the methods of chemical research. A written report on work accomplished is required at the end of each semester. Nine hours of library and laboratory per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B140', 'Public Communication', 'UG', 3, 'Public speaking and the principles and criticism of oral public communication,  to include performance by students.');
