INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B190', 'Introduction to Communication Studies', 'UG', 3, 'An introduction to communication studies as a field of study,  including the concepts,  ideas,  issues,  research methods and theories associated with the discipline.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B201', 'Interpersonal Communication', 'UG', 3, 'Presents basic concepts for understanding communication in interpersonal relationships. It combines a theoretical approach with a skills approach to the study of interpersonal communication.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B210', 'Writing Across Media Platforms', 'UG', 3, 'Students will learn practical skills to help them succeed in writing for specifically online news environments.  Emphasis is given to clear and effective communication and professional standards as well as the need to tailor the message to the audience and the platform through which it is communicated.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B215', 'Introduction to Communication Technologies', 'UG', 3, 'Introduction to the relationships among communication,  technology,  and society and investigates the role of technology in the ways we communicate,  interact,  and think about our world.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B216', 'Digital Communication Technologies', 'UG', 3, '(Prerequisite: COMM B140 or COMM B201) This course introduces students to digital communication technologies from both a theoretical and practical framework. Students will understand how to use communication technologies to advance communication strategies to multiple audiences.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B220', 'Communication and Popular Culture', 'UG', 3, 'Explores the complex relationships of language,  visual images,  mediated communication,  and cultural values.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B225', 'Single Camera Production', 'UG', 3, 'This course introduces students to the fundamentals of video production. Students will gain experience in pre-production,  production,  and post-production of short projects.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B230', 'Organizational Communication', 'UG', 3, 'Fundamentals of oral communication within business and professional settings. Includes performance.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B240', 'Media and Society', 'UG', 3, 'An introduction to the history,  evolution and cultural impact of traditional and digital platforms,  enabling students to develop a critical perspective of media content.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B250', 'Theories of Communication', 'UG', 3, 'Investigation of theories and concepts used to explain communication. Includes oral communication.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B255', 'Communication Studies Research', 'UG', 3, 'An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B300', 'Nonverbal Communication', 'UG', 3, 'Examination of the dynamics of nonverbal behavior through exploration of scholarly research and the application of practical theory to foster greater understanding of nonverbal messages across social contexts.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B303', 'Communication Law', 'UG', 3, 'An overview of the key areas of First Amendment law,  and the important U.S. Supreme Court cases that have addressed the Constitution''s guarantee of free speech and free press.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B305', 'Television Studio Production I', 'UG', 3, 'This course is devoted to learning the techniques of television studio production. Students will learn preproduction planning,  script development,  lighting design,  audio design,  the art of three studio-camera shooting,  technical directing and studio television directing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B306', 'Media 2.0', 'UG', 3, 'This course explores the changing environment of tradiational production and distribution of media. Students will engage in the production and distribution of their work on the internet.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B307', 'Documentary Theory & Aesthetics', 'UG', 3, 'This course is a theoretical consideration of documentary filmmaking,  covering the subgenres,  conventions,  evolution,  social impact,  and contemporary issues of the genre. Students will watch and critique films that represent a variety of approaches to the genre.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B308', 'Persuasion & Social Influence', 'UG', 3, 'An in-depth exploration of the art and science of persuasion and social influence. Topics of study include definitions and models of persuasion,  individual communicator characteristics important in the complex process of persuation,  conformity and influence in groups,  persuasive language and nonverbal cues,  principles of rhetoric and rhetorical devices,  compliace-gaining communication,  motivational appeals,  deception,  and the ethical dimensions of persuasion and social influence.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B310', 'Inactive Fall 2015 - Theories of Human Communication', 'UG', 3, 'Investigation of theories and concepts used to explain human communication.  Includes oral presentation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B320', 'Inactive Fall 2015 - Communication Studies Research', 'UG', 3, 'An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B325', 'Advocacy and Opposition', 'UG', 3, 'Major focus on models of argument and how they are presented in various communication contexts.  Student debating included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B328', 'Introduction to Public Relations', 'UG', 3, 'A cross-disciplinary approach to the practice of public relations and its role in contemporary society,  including a theoretical and practical understanding of relationship management.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B340', 'Oral Interpretation of Literature', 'UG', NULL, '{=THEA B340}  A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B342', 'Communication in Sports', 'UG', 3, NULL);
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B343', 'Classroom Communication', 'UG', NULL, 'This course is designed for prospective teachers/ trainers in all disciplines,  at all [Level]s. This course provides students both a cognitive and experiential understanding of the role of communication in the classroom.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B345', 'Storytelling in Contexts', 'UG', 3, 'This course analyzes the role of storytelling in everyday life. A variety of contexts will be examined and students will study storytelling techniques and use these to tell stories.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B350', NULL, 'UG', 3, NULL);
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B385', 'Gender & Communication', 'UG', NULL, 'This course examines how the concepts of sex,  gender,  and sexuality affect human and mediated communication and,  in turn,  how cummincation affects our understanding of these concepts.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B389', 'Small Group Communication', 'UG', NULL, 'The development of the attitudes,  skills and knowledge of methods of effective participation in discussion in conferences,  committees and other small groups.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B390', 'Family Communication', 'UG', 3, 'A basic introduction to the study of how communication is used in the family to develop,  maintain,  enhance or disturb marital and family relationships.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B398', 'Topics in Communication Studies', 'UG', 3, 'Reading and research on selected communication studies topics. Course content varies and will be announced in the schedule of classes by suffix and title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B399', 'Independent Studies', 'UG', 3, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for Academic Affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B400', 'Communication and Popular Culture', 'UG', 3, '(Prerequisite: Junior standing) COMM B400  Explores the complex relationships of language,  visual images,  mediated communication,  and cultural values in popular culture.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B401', 'Public Relations Campaigns', 'UG', 3, 'An experiental-based seminar on the planning,  development,  and execution of a comprehensive public relations campaign for organizational or non-profit entities.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B402', 'Sports Broadcasting', 'UG', 3, 'The course provides a strong foundation the field of sports broadcasting. Students will explore the key issues that drive the sports broadcasting industry and will participate in the production of sports braodcasting.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B403', 'Documentary Production', 'UG', NULL, 'A course devoted to the study of techniques of producing documentaries on video. The work will be founded in an historical survey of the genre in film and television. The class will include single camera production projects by class production teams.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B404', 'Power,  Discourse & Social Identity', 'UG', NULL, 'This course examines notions of identity in public discourse. Students will be introduced to theories of discourse,  identity,  and power in public discourse (i.e.,  legal,  mediated,  policy,  etc.) on current social issues.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B405', 'Television Studio Production II', 'UG', 3, 'This course is devoted to learning advanced techniques of television studio production. Students will extend previously learned skills of television studio production and will individually produce televsion shows to be aired on local outlets.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B450', 'Intercultural Communication', 'UG', 3, 'A study of cultural differences in human communication with focus on theoretical and experiential approaches toward gaining competence in communicating across cultures.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B490', 'Communication Studies Capstone', 'UG', 3, 'Provides students with the opportunities to integrate the knowledge and skills they have acquired as communication studies majors as well as provide experiences for students to exhibit competent communication skills learned during their program of study.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('COMM', 'B495', 'Internship in Communication Studies', 'UG', 3, '(Prerequisite:  Communication Studies Major only,  15 hours of communication studies,  permission of instructor).  Provides students with the opportunity to applky skills and knowledge across socially and culturally diverse populations in a professional setting.  Minimum requirement of 150 service hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B290', 'Great Books of the West', 'UG', 3, '{=ENGL B290}   Selected masterpieces of Western literature,  with emphasis on non-English language texts in translation which are foundational to literature in English,  including works by Homer,  Dante,  Cervantes,  Voltaire,  Goethe and Flaubert.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B291', 'Introduction to Non-Western Literature', 'UG', 3, '{=ENGL B291} Selected masterpieces of non-western literature. Works may range from antiquity to the present.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B381', 'The Renaissance', 'UG', 3, 'CPLT B381 - THE RENAISSANCE (3). {=ENGL B381} Literature of the Renaissance,  in its cultural contexts,  explored through representative works.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B382', 'The Enlightenment', 'UG', 3, '{=ENGL B382} Literature of the Enlightenment in its cultural contexts,  explored through representative works.');
