 ('CPLT', 'B384', 'Realism', 'UG', 3, '{=ENGL B384} Literature of Realism in its cultural contexts,  explored through representative works.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B385', 'Modernism', 'UG', 3, '{= ENGL B385} Literature of Modernism in its cultural contexts,  explored through representative works.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B386', 'Postmodernism', 'UG', 3, '{=ENGL B386} Literature of Postmodernism in its cultural contexts,  explored through representative works.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B395', 'Classical Drama', 'UG', 3, '{=ENGL B395} Representative plays by Greek and Roman dramatists.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CPLT', 'B397', 'Modern European Drama', 'UG', 3, '{=ENGL B397} Continental plays from the mid-19th century to the present.');
