INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B101', 'Introduction to Computer Concepts', 'UG', 3, '(Prereq: two years of college preparatory mathematics or equivalent) History,  application and social impact of computers; problem-solving,  algorithm development,  applications software and programming in a procedural language. Open to all majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B102', 'Introduction to HTML and CSS', 'UG', 3, '(Prereq: two years of college preparatory mathematics) Introduction to systematic computer problem-solving and programming for a variety of applications. Open to all majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B104', 'Software Design and Development', 'UG', 3, '(Prereq: two years of college preparatory mathematics). Develop a basic competence in scientific in scientific computing using the Matlab programming language. Previous programming experience is not required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B145', 'Java Programming Algorithmic Design I', 'UG', 4, 'Problem solving,  algorithmic design and programming. Three lectures and two laboratory hours per week. Open to all majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B146', 'Algorithmic Design II', 'UG', 4, 'Continuation of CSCI B145. Rigorous development of algorithms and computer programs; elementary data structures. Three lecture hours and two laboratory hours per week. Open to all majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B150', 'Introduction to Computational Science', 'UG', 3, 'Topics include computing theories,  programming languages,  modeling/simulation and visualization tools,  and case studies of problem solving and high performance computing in natural sciences.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B201', 'Introduction to Computer Security', 'UG', 3, 'Introduction to the theory and practice of computer security,  including security policies,  authentification,  digital certificates,  firewalls,  malicious code,  legal and ethical issues,  and incident handling. Not auditable.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B202', 'Introduction to Front-End Web Development', 'UG', 3, '(Prerequisites: CSCI B145 & CSCI B150) Application of programming techniques to the development of interactive,  event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS)  essentials,  followed by significant coverage of scripting languages,  libraries,  and frameworks for manipulating the Document Object Model.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B207', 'Computer System Administration', 'UG', NULL, '(Prerequisite: CSCI B145 & CSCI B150) Account maintenance,  backups,  restoration,  system configuration,  resource allocation and monitoring,  network management,  peripheral administration,  emphasis on Microsoft Windows and UNIX/Linux systems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B209', 'Special Topics in Computer Programming', 'UG', 3, 'Programming and application development using selected programming languages. Course content varies and will be announced in the schedule of classes by suffix and title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B211', 'Digital Logic Design', 'UG', 3, 'Number systems,  Boolean algebra,  logic design,  sequential machines.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B212', 'Introduction to Computer Architecture', 'UG', 3, '(Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory,  and input/output control and devices.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B240', 'Introduction to Software Engineering', 'UG', 3, 'Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B250', 'Mobile Application Development', 'UG', 3, 'Introduction to Mobile application development fundamentals including development platforms,  user interface design,  data persistence,  map Application Programming Interface.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B255', 'Introduction to Computational Biology', 'UG', 3, 'Introduction to the Linux operating system,  an introduction to computer science and programming using high-[Level] languages,  and a survey of various computational tools used in exploring and analyzing biological data');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B265', 'Graphics,  Multimedia and User-Interface Design', 'UG', NULL, 'Principles of windowing systems; Graphical interface design and implementation; Processing graphical data using a high [Level] programming language.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B280', 'Computational Mathematics', 'UG', 4, 'Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations,  diagonalization,  and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B317', 'Introduction to Digital Forensics', 'UG', NULL, '{ISAT B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics,  electronic discovery,  legal issues related to digital analysis,  and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms,  including Windows,  iOS,  and Android devices.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B320', 'Database Systems Management', 'UG', 3, 'Provides foundations of database systems for students with little prior database experience; topics include relational algebra,  data models,  schema design and normalization,  storage management,  query,  transaction,  concurrency control and consistency');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B321', 'Database-Driven Applications Development', 'UG', 3, 'Development of data-driven software for devices including smart phones,  tablets,  handheld units,  and other general purpose computing platforms. Emphasis on database connectivity,  design patterns,  human-computer interfaces and usability.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B350', 'Techniques of Computation', 'UG', 3, '(Prerequisite: CSCI/MATH B280 [or MATH B230 and MATH B242],  and CSCI B146 or CSCI B240 or consent) Core techniques in the scientific computing process; the focus is on numerical methods,  data structures,  and computing optimization.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B360', 'Operating Systems', 'UG', NULL, '(Prereq: CSCI B145 or a high-[Level] programming language). Introduction to operating systems. Topics include evolution of operating systems,  components and performance,  process management,  memory management,  file systems,  security and advanced topics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B365', 'Computer Graphics', 'UG', 3, '(Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing,  clipping,  lighting,  and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B399', 'Independent Study', 'UG', NULL, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for academic affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B401', 'Information Security Principles', 'UG', NULL, '(Prerequisite: CSCI B201) This course extends fundamental computer security concepts,  practices,  and issues,  introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention,  detection,  and response tools and approaches; risk and risk assessment; human factors in information security; legal,  ethical,  and professional issues.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B409', 'Selected Topics in Computing', 'UG', 3, '(Prerequisite: Permission of Instructor) Intensive study of a particular topic or topics in computing. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B416', 'Introduction to Computer Networks', 'UG', 3, 'Fundamental concepts in computer networks,  protocols,  and applications. Topics include: network architectures,  transmission media,  protocols,  wireless networks,  routing,  security and latest topics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B419', 'Mathematical Modeling', 'UG', NULL, 'CSCI B419- MATHEMATICAL MODELING (4).  { MATH B419} (Prerequisite: C or better in MATH B142 and CSCI B104 or consent) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B420', 'Database Management Systems II', 'UG', 3, '(Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure,  function,  and package implementation; trigger creation and usage; query optimization techniques; security considerations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B422', 'Introduction to Data Mining', 'UG', 3, 'Introduction to information processing techniques and mathematical tools to assemble,  access,  and analyze data for decision support and knowledge discovery.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B426', 'Special Topics in Computer Networks and Distributed Computing', 'UG', NULL, '(Prereq: BCSE 416.) Advanced topics in Computer Networks,  course content varies and will be announced in the schedule of classes by suffix and title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B437', 'Information Technology Project Management', 'UG', NULL, '(Prerequisite: CSCI/ISAT B207 and MGMT B371,  or consent of instructor) This course introduces students to project management concepts,  techniques,  and tools used by project managers to plan,  initiate,  manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope,  cost,  people,  expectations,  risk,  communications,  and procurement; agile methodologies; project management software.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B450', 'Modeling and Simulation', 'UG', 3, 'An introduction to modeling and simulation. Topics include fundamental techniques in designing,  coding,  and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B452', 'Computer Game Development', 'UG', NULL, 'Game concept development; User interface design; Graphics (2D,  3D,  animation,  and advanced techniques); Game physics; Real-time interaction; Intelligent characters; Software engineering considerations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B463', 'Introduction to Digital Image Processing', 'UG', NULL, 'Overview of digital image processing techniques and their applications; transforms,  enhancement,  analysis,  segmentation,  compression,  color image processing; computer projects.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B466', 'Data Visualization', 'UG', 3, 'Concepts of visualization and human vision system; hardware and software basics of computer graphics; visualization pipeline; data representation and processing in computer graphics; algorithms in rendering 2D and 3D geometry; image processing; applications of visualization in science and technology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B469', 'High Performance Computing', 'UG', 3, '(Prereq:  BCSE 104 or BCSE 145,  BMTH 230 or BCSE/BMTH 280,  and BCSE 150) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B470', 'Software Testing and Verification', 'UG', 3, 'Testing theory and techniques for software systems; software development process,  specification,  black-box and white-box testing,  configuration and compatibility testing,  usability testing,  quality assurance,  testing planning,  and documentation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B499', 'Computational Science Co-op/Internship', 'UG', 3, 'Practical full-time work experience in an area of Computational Science,  selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit,  45 minimum internship work hours required; for 2 credits,  90 work hours,  and for 3 credits,  135 work hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B500', 'Practical Computing for Computational Scientists', 'MS', 3, 'Provides practical,  hands-on experience in the use of computational tools commonly needed for research and data analysis. This course is taught using the Linux operating system and the Python programming language,  including scientific computing libraries.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B501', 'Advanced Statistical Methods', 'MS', 3, '(Prereq: STAT B340 or consent of instructor) Advanced statistical methods. Topics include Bayes Theorem,  likelihood function and maximum likelihood estimates,  frequentist statistical methods,  Bayesian statistics and nonparametric methods.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B502', 'Numerical Analysis and Computing', 'MS', 3, '(Prereq: CSCI B280 and MATH B240,  or consent of instructor) Numerical analysis and computing. Topics include nonlinear equations,  differentiation and integration,  linear systems,  matrix factorizations,  ODE and PDE,  and spline functions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B515', 'Topics in Computational Science', 'MS', 3, '(Prereq: undergraduate programming experience or consent) Introduction to topics in computational science. Course content varies and will be determined by the instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B516', 'Data Communications and Networks', 'MS', 3, '(Prereq: undergraduate programming experience or consent of instructor) Structure,  design and analysis of computer networks,  protocols,  and applications. Topics include network architectures,  transmission media,  protocols,  security,  latest topics,  and network programming.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B520', 'Advanced Topics in Database Systems', 'MS', 3, '(Prerequisite: CSCI B320,  or consent of instructor) Advanced topics in database systems and their implementation using SQL and its programmatic extensions. Topics include: advanced querying,  optimization,  stored logic development,  and database security.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B522', 'Data Mining', 'MS', 3, '(Prereq: CSCI B501 or CSCI B502) Concepts and techniques of data mining. Topics include linear classification/regression,  logistic regression,  model regularization,  decision trees,  mixture models,  and hidden Markov models.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B550', 'Systems Modeling and Simulation', 'MS', 3, '(Prerequisite: CSCI B500,  B501,  and B502,  or consent of instructor) Introduction of computational tools,  models,  system dynamics,  input and output analysis,  and performance analysis.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B563', 'Digital Image Processing', 'MS', NULL, '(Prereq: CSCI B104,  MATH B230 or B380,  STAT B340 or consent of instructor) Digital image processing techniques and their applications; transforms,  enhancement,  analysis,  segmentation,  compression,  color image processing; computer projects.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B566', 'Data Visualization', 'MS', 3, '(Prereq: CSCI B350 and CSCI B365,  or consent of instructor) Scientific data visualization. Topics include visualization pipeline,  data representation,  visualization algorithms,  image processing,  applications in science and technology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B569', 'High Performance Computing', 'MS', 3, '(prereq: CSCI B150,  CSCI B104 or B145,  MATH B230 or CSCI B380,  or consent of instructor) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.');
