INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B570', 'Software System Design and Implementation', 'MS', 3, '(Prereq: CSCI 500 or consent of instructor) Current practice and research in software design and implementation. Topics include project planning and management,  requirement specification,  design process,  implementation,  testing and reliability,  documentation,  and maintenance.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B599', 'Independent Study', 'MS', 3, 'Research under the supervision of a faculty. The course may include directed readings,  applied work,  research on an existing or new project,  or other activities deemed appropriate.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B601', 'Principles of Computer Security', 'MS', NULL, '(Prerequisite: CSCI B201 or consent of instructor) Computer security principles and practice. Topics include: cryptographic tools,  access control,  database security,  software security,  network security,  common attack vectors,  intrusion detection,  and security ethics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B622', 'Data Management and Analytics', 'MS', NULL, '(Prerequisite: CSCI B320 or consent of instructor) The management and systematic computational analysis of data. Topics include: structured and unstructured data management,  data wrangling,  computational analytics methodologies,  and data visualization.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B699', 'Industrial or Research Internship', 'MS', 1, 'Practical full-time work experience in an area of Computational Science,  selected by the student and approved by the Department Chair or Computational Science Program Coordinator.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B797', 'Research Project', 'MS', 3, 'Research under the supervision of a faculty member. A formal research report and professional presentation are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSCI', 'B799', 'Master''s Thesis', 'MS', 3, 'Research under the supervision of a committee of three appropriate faculty members. The thesis must also be presented at an appropriate forum.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSXE', 'B200', 'Statics', 'UG', 3, 'Overview of digital image processing techniques and their applications; transforms,  enhancement,  analysis,  segmentation,  compression,  color image processing; computer projects');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSXE', 'B211', 'Engineering Graphics and Visualization', 'UG', 3, 'Principles and practice of visualization and graphical representation using modern computer-aided design tools.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSXE', 'B260', 'Solid Mechanics', 'UG', 3, 'Basic concepts of stress and strain. Behavior of structures under applied loads including forces,  torques,  moments and combinations thereof. Deformations of elastic relationships between stress and strain.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSXE', 'B290', 'Thermodynamics', 'UG', 3, 'Definitions,  work,  heat,  energy. First law analysis of systems and control volumes. Second law analysis.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSXE', 'B310', 'Dynamics', 'UG', NULL, 'Kinematics of particles and rigid bodies. Kinetics of particles,  emphasis on Newtons second law: energy and momentum methods for the solution of problems. Applications of plane motion of rigid bodies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('CSXE', 'B327', 'Design of Mechanical Elements', 'UG', NULL, 'Design against static failure and fatigue failure of structural members and machine parts; design and selection of components including fasteners,  welds,  shafts,  springs,  gears,  bearings,  and chain drives.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B101', 'Consumer Economics', 'UG', 3, 'The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management,  marketing,  finance and accounting will be integrated the course. A topical survey of business issues and challenges.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B221', 'Microeconomics', 'UG', 3, 'Microeconomic analysis theory of the firm,  market structure,  cost and output determination; market pricing; income distribution and international economics. Students cannot receive credit for both ECON B221 and B224.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B222', 'Macroeconomics', 'UG', 3, 'Macroeconomic analysis: basic definitions and concepts: mechanics of pricing and the fundamentals of American capitalism; national income economics,  income and employment theory and monetary and fiscal policy.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B224', NULL, 'UG', NULL, 'Micro- and macroeconomic principles of markets,  government policy and household or firm decision making. Open to all students. Credit not granted for both ECON B224 and ECON B221 or B222.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B301', 'Money and Banking', 'UG', 3, 'The role of money in the market economy. Commercial banks,  the Federal Reserve System and monetary policy.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B303', 'The International Economy', 'UG', 3, 'Survey of international economic issues and institutions,  from a historical point of view including the interconnections of economies around the world.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B311', 'Issues in Economics', 'UG', 3, 'The nature and causes of major economic problems facing the nation and its communities and policy alternatives designed to solve them. The philosophy and methodology of economics in social problem solving.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B330', 'Beaufort Economy: Past,  Present,  Future', 'UG', NULL, '(Offered only in Maymester)  We will explore the history of Beaufort County using economic models to understand how and why the Beaufort economy has changed and how the local economy will likely evolve over time. The goal of this course is to get students to understand market forces,  the importance of capital,  government,  leadership and the dynamics of economic change.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B364', 'Financial Institutions', 'UG', 3, 'A study of the functions and operations of financial institutions and their relationships to the commercial banking system and the general economy. Attention is devoted to savings institutions,  insurance companies,  rural and urban real estate credit,  consumer credit and associated topics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ECON', 'B406', 'Labor Economics', 'UG', NULL, 'A study of labor market institutions,  trends in labor market activity and the effects of government policy on the labor market.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B100', 'Clinical Observation & Analysis', 'UG', 3, 'Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate,  classroom management,  lesson clarity instructional variety,  task orientation,  leaning process,  student success,  and performance outcomes and higher thought processes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B201', 'Teacher Cadet II', 'UG', 3, '(Prerequisite: EDCI B100) This course focuses on the dynamics of human learning and the psychological principles that serve as the foundation for educational practice. The general goal is to provide a basic introduction to research findings from the discipline of psychology that can be used to inform the planning and implementation of effective instructional practices in the classroom.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B210', 'Clinical Observation and Analysis', 'UG', 3, 'Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate,  classroom management,  lesson clarity instructional variety,  task orientation,  leaning process,  student success,  and performance outcomes and higher thought processes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B243', 'Resources in Teaching', 'UG', 3, 'Introduction to technological resources relevant to the teaching profession including computer technology,  educational software,  and telecommunications.   This course focuses on examining how applying technology in the classroom can be used to support teaching and learning and addresses the methods and materials used for technology integration.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B320', 'Curriculum Planning,  Technology,  and Assessment in Secondary Education', 'UG', 3, '(Prerequisite or Corequisite: EDCI B100) Explores issues of development and education of adolescents including curriculum,  instruction,  activities,  materials,  and authentic assessment. Prospective teachers will understand the importance of differentiation and technology integration at all [Level]s of instruction and assessment. Parental involvement,  community resources,  and collaborative relationships with specialists are included components of this course.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B322', 'Cultural Diversity in Education', 'UG', 3, 'This course prepares students to demonstrate an understanding of the depth and breadth of cultural diversity within the United States,  as well as the ways that the intersections of cultures within the classroom shape teaching and learning outcomes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B399', 'Independent Study in Education', 'UG', NULL, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for academic affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B400', 'Selected Topics in Education', 'UG', 3, 'Intensive study of selected topics,  themes,  and/or interdisciplinary concerns in education. Course and content varies and will be announced in the schedule of classes by suffix and title.  Topics may include: Gifted Education; Teaching English Language Learners; Play,  Music and Movement in Early Childhood Education; Classroom Management,  Assessment & Approaches in Differentiating Instruction,  etc.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B441', 'Organization and Management in the Diverse Classroom', 'UG', 3, 'Structuring of the physical,  social,  and instructional environment to maximize learning in a supportive,  diverse classroom. Development of a comprehensive understanding of practice,  proactive,  and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches,  inclusive education,  ESOL learner needs,  conflict resolution,  and the promotion of learning communities are components of this course.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B442', 'Organization & Management in the Secondary Classroom', 'UG', 3, '(Prerequisite: Admission the Professional Program) Structuring of the physical,  social,  and instructional environment to maximize learning in a supportive,  diverse secondary classroom. Development of a comprehensive understanding of practice,  proactive,  and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorist and constructivist approaches,  inclusive education,  ESOL learner needs,  conflict resolution,  ABC Analysis,  and the promotion of learning communities are components of this course.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDCI', 'B599', 'Selected Topics in Education', 'MS', NULL, '(Prerequisite: Permission of Instructor) Introduction to topics in education. Course content varies and will be determined by instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B340', 'Education of the Young Child', 'UG', 3, 'A study of the physical,  emotional,  intellectual and social components of development,  birth through age eight and their relationship to the education of the young child birth - age eight. Diagnosis and assessment of development are addressed. Programs serving young children and their families will be discussed. The administration of these programs as well as advocacy efforts are included. Observation and participation in early childhood settings is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B342', 'Curriculum Planning and Development in Early Childhood Education', 'UG', 3, '(Prerequisite or Co-requisites: EDCI B210; EDEC B340; EDPY B335). This curriculum course is designed for prospective teachers in the nursery,  kindergarten and primary schools. The course explores various issues involved in the development and education of children from the ages of four to eight. Attention is given to learning activities,  materials and equipment suitable for teaching at this [Level]. Emphasis is given to appropriate methods for assessment of children ages four through eight and to the relationship of various subject areas to the physical,  social,  emotional and cognitive development of the child. Philosophy,  history of early childhood education,  classroom management,  societal influences,  parental involvement and community resources are included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B345', 'Family in Early Life Childhood', 'UG', 3, '(Preq: Admission to Professional Program in Education) Principles,  practices and content of family life and family-school relations as related to young childrens learning and development in various settings during the early childhood years,  birth through eight. This course will provide a foundation for using family life knowledge in relating to young children and families in effective ways.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B435', 'Math Experiences in Early Childhood Education', 'UG', 1, '(Prerequisite: EDCI B210; Admission to the Professional Program in Education or permission of the Department Chair; Co-requisites: EDEC B436,  EDEC B444,  EDEC B440P). This methods course includes the basic content of the academic area of mathematics to be presented to PreK-3rd grade children. Developmentally appropriate experiences,  learning activities,  materials and equipment to aid in the development of math concepts in young children are presented. Diversity-related influences and needs of exceptional learners are also addressed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B435P', 'ABEYANCE: Practicum in Teaching Mathematics in Early Childhood Education', 'UG', 1, '(admission to the Professional Program in Education or permission of Dept Chair). Supervised clinical experience in an early childhood setting. Observation and participation in a classroom setting is required with a focus on math learning experiences,  materials and equipment. Seminar and group discussions are included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B436', 'Science and Social Studies Experiences in Early Childhood Education', 'UG', 3, '(Prerequisite: EDCI B210; Admission to Professional Program in Education or permission of the Department Chair; Co-requisites: EDEC B435,  EDEC B444,  EDEC B440P). This methods course includes the basic content in the inquiry areas of science and social studies to be presented to PreK - 3rd grade children. Developmentally appropriate inquiry experiences,  learning activities,  materials and equipment are presented. Diversity-related influences and needs of exceptional learners are also addressed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B436P', 'ABEYANCE: Practicum in Teaching Science and Social Studies in Early Childhood Education', 'UG', 1, '(admission to the Professional Program in Education or permission of Department Chair)  Supervised clinical experience in an early childhood setting.  Observation and participation in a classroom setting is required with a focus on science and social studies inquiry learning experiences,  materials and equipment.  Seminar and group discussions are included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B440P', 'Practicum: Teaching Integrated Lessons in Early Childhood Education', 'UG', NULL, 'Prerequisite: Admission to the Professional Program or permission of the Department Chair; Co-requisite EDEC B435,  EDEC B436,  and EDEC B444). Supervised clinical experience in an early childhood setting. Teacher candidates will apply principles of planning,  instruction,  assessment,  management,  and professionalism in diverse field-based settings serving students in grades P-3. Offered in Fall.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B444', 'Language Development and Communicative Skills', 'UG', 3, '(admission to the Education Professional Program or special permission by the Department Chair)  This course deals with the relationship of language development and thinking to teaching communicative skills to young children.  Specific areas covered include activities across the language arts curriculum strands: reading,  writing,  listening,  speaking,  viewing and visually representing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B444P', 'Practicum in Teaching,  Language,  Communication and Critical Thinking in Early Childhood Education', 'UG', NULL, '(Prereq: BEDC 210,  Admission to Professional Program in Education or permission of Department Chair; Coreq: BEDE 444.) Supervised clinical experience in an early childhood setting.  Observation and participation in classroom setting is required with a focus on language,  communication and critical thinking skills learning experiences,  materials and equipment.  Seminars and group discussions included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B469', 'Internship in Early Childhood Education', 'UG', 12, '(admission to Professional Program in Education and Internship) A program of observation and teachng in the public schools under the supervision of university and public school  personnel.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEC', 'B476', 'Senior Seminar in Early Childhood Education', 'UG', 3, 'The synthesis and critical evaluation of professional studies in early childhood education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B320', 'Cirriculum Planning,  Development and Assessment in the Elementary School', 'UG', NULL, 'This course explores issues involved in the development and education of children including curriculum,  instruction,  activities,  materials,  grouping,  grading and appropriate methods of authentic assessment,  as well as analysis of standardized test results in relation to the physical,  social,  emotional,  and cognitive development of grade 2-6 learners for optimal learning. Parental involvement,  community resources and collaborative relationships with specialists are included components of this course.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B330', 'Intergrating the Arts in Elementary Education: Art,  Music and Movement', 'UG', 3, 'Provides opportunities to develop competence in selecting and using a variety of high quality instructional methods,  resources,  and assessment strategies for teaching art,  music,  and movement to elementary children.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B431', 'Teaching Mathematics in the Elementary School', 'UG', 3, 'Materials,  resources,  programs,  and methods for teaching mathematics to diverse learners in grades 2-6. Problem solving,  mathematical content and process connections,  as well as assessment,  diagnosis,  and remediation will be addressed. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.    Admission to the Department of Education''s Professional Program for Elementary Education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B432', 'Teaching Science in the Elementary School', 'UG', 3, 'Materials,  resources,  programs,  and methods for teaching science in an inquiry format to diverse learners in grades 2-6. Included are supervised practicum experiences that promote reflective teaching in elementary school settings. Prerequisite:   Prereq: Admission to the Department of Education''s Professional Program for Elementary Education.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B434', 'Language Arts in the Elementary School', 'UG', NULL, 'This course focuses on methods of teaching language arts and writing in grades 2-6. Course content includes strategies for teaching the conventions of language,  the writing process,  writing traits,  assessment methods,  and incorporating content area reading and writing.   Prereq: EDCI 210,  EDRD 218 and to the admission to the Department of Education''s Teacher Education Professional Program for Elementary Education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B440P', 'Math/Science Practicum', 'UG', NULL, 'Supervised clinical experience in an elementary education setting. Teacher candidates will apply principles of planning,  instruction,  assessment,  management,  and professionalism in diverse field-based settings serving students in grades 2-6. Offered in Fall.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B441', 'Organization and Management in a Diverse Classroom', 'UG', NULL, 'Structuring of the physical,  social,  and instructional environment to maximize learning in a supportive,  diverse classroom. Development of a comprehensive understanding of practice,  proactive,  and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches,  inclusive education,  ESOL learner needs,  conflict resolution,  and the promotion of learning communities are components of this course.  Admission to the Department of Education''s Teacher Education Professional Program for Elementary Education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B443', 'Teaching Social Studies in the Elementary School', 'UG', 3, 'Materials,  resources,  programs,  and methods for teaching social studies to grades 2-6 for learners to become well-informed citizens in a culturally diverse and democratic society. Included are supervised practicum experiences that promote reflective teaching in the elementary school setting.  Prereq: Admission to the Department of Education''s Professional Program for Elementary Education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B470', 'Internship in Elementary School', 'UG', 12, 'A program of observation and teaching in the public schools under the supervision of university and public school personnel.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEL', 'B476', 'Senior Seminar', 'UG', 3, 'The synthesis and critical evaluation of professional studies in elementary education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEX', 'B300', 'Introduction to Exceptional Learner', 'UG', 3, '(Admission to the Professional Program or permission of Department Chair). A survey of the development of special education,  the current legal guidelines with emphasis on public school mandates,  the various clusters of exceptionalities: their definition,  classification,  identification,  prevalence,  causes,  characteristics and educational needs,  including mainstreaming in the regular classroom.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDEX', 'B301', 'Introduction to Exceptional Populations at the Secondary [Level]', 'UG', 3, '(Prerequisite: EDRD B319 & EDCI B320) Introductory course designed to survey the development of special education in high school settings; the current legal guidelines with emphasis on public school mandates; the various clusters of exceptionalities,  their definitions,  classification,  identification,  prevalence,  causes,  characteristics,  education needs; and the inclusion of students with exceptionalities within the general education classroom at the secondary [Level].');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDFO', 'B321', 'Foundations of American Education', 'UG', 3, 'Extensive treatment of social,  political,  economic and philosophical influences that have shaped public education. Study of the financial,  organizational and legal aspects of education. Library assignments provide a working knowledge of professional standard references and journals.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDFO', 'B357', 'Sociology of Education', 'UG', 3, '{=SOCY B357} Analysis of educational institutions,  organizations,  processes and their effects in contemporary society.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDME', 'B430', 'Teaching Mathematics in the Secondary School', 'UG', 3, '(Prereq: Admission to professional program in education; Coreq: EDME B430P) This course includes teaching methods for secondary mathematics education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDME', 'B430P', 'Practicum in Teaching Mathematics in the Secondary School', 'UG', 3, '(Prereq: Admission to professional program in education; Coreq: EDME B430) Supervised clinical experience in a secondary mathematics setting. Observation and participation in a classroom setting is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDME', 'B469', 'Internship in Secondary Mathematics Education', 'UG', 12, 'A program of observation and teaching secondary mathematics in the public schools under the supervision of university and public school personnel.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDME', 'B476', 'Senior Seminar in Secondary Mathematics Education', 'UG', 3, 'The synthesis and critical evaluation of professional studies in secondary mathematics education.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDPH', 'B231', 'Personal and Community Health', 'UG', 3, 'A study of the principles and practices of personal and community health and their application to the health education of the young child.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDPY', 'B333', 'Introduction to Child Growth and Development', 'UG', 3, 'Basic course designed to familiarize the prospective teacher with the patterns of social,  emotional,  physical and intellectual growth of the individual. Development of these growth patterns from the prenatal stage to the onset of adolescence.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDPY', 'B334', 'Adolescent Growth and Development', 'UG', NULL, 'The study of adolescent physical,  intellectual and emotional development. Particular emphasis is placed on the social interactions of adolescents with each other and society at large.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDPY', 'B335', 'Introduction to Educational Psychology', 'UG', 3, '(Prereq or Coreq: BEDC 210)  This course will introduce pre-service teachers and education majors to psychological principles,  theory and data upon which effective classroom practices are based,  including general methods and techniques.  A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning,  evaluation and control.  Emphasis will be placed on student motivation,  learning problems,  individual differences ad measurement.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDPY', 'B355', 'Introductional to Educational Psychology', 'UG', NULL, 'This course will introduce pre-service teachers and education majors to psychological principles,  theory and data upon which effective classroom practices are based,  including general methods and techniques.  A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning,  evaluation and control.  Emphasis will be placed on student motivation,  learning problems,  individual differences and measurement.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDPY', 'B635', 'Advanced Educational Psychology', 'MS', 3, '(Prerequisite: Permission of Department) This course will introduce and illustrate the proper use of learning theories in providing insights defining and solving problems that may be encountered in educational settings. The emphasis will be on the use of these theories to solve realistic and relevant problems drawn from the classroom teachers own personal experience or from cases in the readings.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B218', 'Children''s Literature', 'UG', 3, 'Reading interests of children and their curricular and developmental needs for literature are explored. The course presents basic information in the field of childrens literature including authors,  illustrators and appropriate reference materials.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B318', 'Foundations of Reading', 'UG', 3, 'This course focuses on the foundations of reading,  including language development,  phonemic awareness,  phonics,  vocabulary,  fluency,  and comprehension. Offered in Fall.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B319', 'Foundations of Reading for Secondary Teachers', 'UG', 3, 'This course provides the basics of teaching reading and writing in secondary content classes. Candidates will be prepared to support students in grades 9-12 who are struggling to read,  write,  and comprehend information through assessment and differentiation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B418', 'Children''s Literature', 'UG', NULL, 'Reading interests of children and their curricular and developmental needs for literature are explored. The course presents basic information in the field of childrens literature including authors,  illustrators and appropriate reference materials.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B419', 'Content Literacy for Secondary Teachers', 'UG', 3, 'This course provides 7-12 grade teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary,  nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B420', 'Emergent Reading Methods and Assessment', 'UG', 3, '(admission to the Professional Program or special permission of the Department Chair)  This course focuses on literacy development,  acquisition of phonemic awareness and phonics,  evidence-based methods of reading instruction and the use of effective assessments for emergent readers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B420P', 'Abeyance - Practicum in Emergent Reading', 'UG', 1, '(admission to the Education Professional Program or special permission of the Department Chair).  This practicum provides supervised clinical experience in an emergent literacy setting.  Demonstration teaching in a classroom setting is required,  with a focus on assessment and remediation of struggling readers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B421', 'Teaching Reading: Diagnosis and Remediation', 'UG', NULL, '(Prereq: BEDR 420 and 420P and Admission to Educational Professional Program or special permission of Department Chair) Clinical and classroom aspects of teaching students with reading difficulties are explored with emphasis on testing procedures,  instructional materials,  and teaching techniques. Issues of diagnosing and teaching based upon the state mandated testing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B425', 'Assessment of Literacy for Early Childhood and Elementary Teachers', 'UG', 3, 'This course instructs teacher candidates to administer and analyze a variety of formal and informal assessments for screening and diagnosis of reading problems at the early childhood and elementary [Level]. The course utilizes both standardized and portfolio assessments.  Offered in Spring.  Pre-requisite: Admission to the Professional Program or special permission of the Department Chair and EDCI B210,  EDCI B243,  and EDRD B318.  Co-requisite: EDRD B430/EDRD 450P.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B428', 'Content Area Literacy for Early Childhood and Elementary Teachers', 'UG', 3, 'This course is designed to instruct teacher candidates,  grades pre-K through 6,  in developing methods and materials that will improve their students literacy skills in content area reading and writing. Offered in Fall.  Admission to the Professional Program or special permission of the Department Chair and EDCI B210,  EDCI B243,  and EDRD B318.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B429', 'Content Literacy for Secondary Teachers', 'UG', 3, 'This course provides 7-12 teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary,  nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B430', 'Instructional Strategies in Literacy for Early Childhood Teachers', 'UG', 3, '(Prerequisite: EDCI B100,  EDCI B243,  EDRD B318; Admission to the Professional Program or special permission of the Department Chair. Corequisite: EDRD B425 & EDRD B450P) This course focuses on research-based instructional strategies for literacy in early childhood classeooms. Course content includes cooperative learning,  critical literacy,  Reader''s and Writer''s Worksop. Specific instruction in the five elements of teaching reading: phonics,  phonemic awareness,  fluency,  vocabulary and comprehension and the 6+1 traits of writing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B430P', 'Abeyance - Practicum in Intermedite Reading', 'UG', 1, '(admission to the Education Professional Program or special permission of the Department Chair).  This practicum provides supervised clinical experience in an elementary grade setting.  Demonstration teaching in a classroom setting is required,  with a focus on assessment and remediation of struggling readers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B433', 'Instructional Strategies for Elementary Teachers', 'UG', 3, '(Prerequisite: Acceptance the Department of Education''s Professional Program) This course focuses on research-based instructional strategies for literacy in elementary classrooms. Course content includes cooperative learning,  critical literacy,  Reader''s and Writer''s Workshop. Specific instruction in the five elements of teaching reading: phonics,  phonemic awareness,  fluency,  vocabulary and comprehension. Reading comprehension and writing processes across the content areas are also included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B450P', 'Literacy/Social Studies Practicum', 'UG', NULL, 'Supervised clinical experience in an early childhood or elementary setting. Teacher candidates will demonstrate proficiency in planning,  assessing and teaching various methods of reading and providing individualized differentiated instruction for struggling/ELL students.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B619', 'Foundations of Reading', 'MS', 3, '(Prerequisite: Permission of Department) This course provides candidates with comprehensive knowledge of the social,  cultural,  and linguistic factors that influence reading development. Emphasis is placed on practical application of theory,  oral language development,  phonemic awareness and phonics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B623', 'Differentiation in Reading Instruction', 'MS', 3, 'This course requires that students conduct in-depth study of effective literacy methods,  materials,  and formative assessment for K-12 classrooms. Emphasis is on serving the instructional needs of diverse students,  including the gifted and talented,  culturally and linguistically diverse learners,  and children and young people with disabilities.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B624', 'Assessment & Instructional Strategies for Reading for ELLs', 'MS', 3, '(Prerequisite: Department Permission) This course focuses on determining reading and language needs of English learners through the use of screening and diagnostic assessments and using that information to inform teaching of English learners within the classroom setting. Candidates learn to administer quick assessments and design instruction and how instruction varies and students acquire language. Candidates choose one student''s data to present in a case study format.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B625', 'Assessment Strategies for Reading Assessment Strategies for Reading', 'MS', 3, 'Teachers will examine various types of assessments that will determine students strengths and areas for further instruction. Teachers will analyze existing data from multiple [Level]s: individual students,  groups of students (class [Level]),  grade [Level]s,  school,  district,  state,  and national [Level] data. They will explain assessment results and demonstrate the ability to advocate for appropriate literacy practices to relevant stakeholders. Teachers will also be able to locate and administer non-biased assessments to culturally and linguistically diverse student. This course aligns with Read to Succeed Legislation requirements for in-service teachers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B629', 'Content Area Reading and Writing', 'MS', 3, 'After gaining a sound theoretical knowledge of the reading and writing processes in nonfiction text,  teachers will apply what they have learned to their own disciplines,  creating strategies that will support students in reading and writing within the context of content area instruction.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B632', 'Action Research for Literacy Education', 'MS', 3, 'Candidates will gain skills necessary for conducting action research in literacy education and coaching.  This includes assessing the needs of teacher/students,  identifying research-based interventions,  designing and implementing a coaching plan including identification of assessment to document effectiveness of plan,  and assessing effectiveness of coaching plan.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRD', 'B640P', 'Practicum in Assessing & Teaching English Language Learners', 'MS', 3, '(Prerequisite: Department Permission) Supervised clinical experience in literacy that is implemented within the classroom. Candidates will practice proficiency in planning,  assessing,  and teaching using various methods of reading and writing that serve the needs of English Language Learners. The main assessment for this course is a diagnostic reading case study.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('EDRM', 'B620', 'Educational Research,  Design,  and Analysis', 'MS', 3, 'This course provides an overview of the principles,  models,  and techniques of educational research. A substantial portion of this course focuses on the acquisition of critical reading skills and on the analysis and interpretation of data produced by educational investigation and inquiry.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B101', 'Composition and Rhetoric', 'UG', 3, 'An introduction to university-[Level] writing,  emphasizing the rhetorical approaches necessary to understand other writers'' purposes and stances,  create effective writing,  and develop processed for composing texts for academic,  civic,  professional,  and personal purposes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B101L', 'Intensive English Composition Laboratory', 'UG', 1, 'Intensive practice in English composition. Special attention devoted to thesis formation,  essay structure,  paragraph structure,  style and mechanics.  (Students may place out of BENG 101L with a sufficiently high score on USCBs English Placement Test.)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B102', 'Composition and Literature', 'UG', 3, 'An extension of composition skills developed in ENGL B101 and an introduction to literature,  emphasizing the interpretive skills and processes necessary to read complex and imaginative texts creatively,  critically,  and rhetorically so students can write responses to - and interventions in - the world around them.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B105', 'Enhanced Composition', 'UG', 3, 'For English majors,  humanities majors,  and all word-lovers: an enhanced version of ENGL B101. An introduction to genres of writing,  including (but not limited to) researched arguments.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B106', 'Enhanced Composition and Literature', 'UG', 3, 'For English majors,  humanities majors,  and all word-lovers: an enhanced version of ENGL B102. An introduction to literary interpretation and the writing of researched arguments about literature.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B180', 'Introduction to Film', 'UG', 3, 'Introduction to critical analysis of film (for all majors).');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B190', 'Introduction to Journalism and Media Studies', 'UG', NULL, 'Introduction to practical skills of contributing to and running a print publication supported by analysis of various media and communication paradigms.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B191', 'Journalism Laboratory', 'UG', 1, 'Supervised participation in the production of the Tidal Tribune. May be repeated for up to 8 credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B200', 'Introduction to English Studies', 'UG', 3, 'An introduction to the history,  present state,  and potential futures of English Studies with an emphasis on the distinctive fields,  methods,  and terminology employed in the discipline of English.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B211', 'Editing and Publishing Practicum', 'UG', 1, 'Provides students with practical experience in editing and publishing through their work on the critical journal or literary magazine; may be taken up to 6 times for credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B215', 'Writing Center Practicum', 'UG', 3, 'Provides students with ongoing practice and training in teaching and tutoring writing. May be taken up to 6 times for credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B222', 'Creative Writing Across the Curriculum', 'UG', 3, 'Introductory [Level] workshop designed to foster a students appreciation for,  and ability to create brief works of adult [Level] fiction,  poetry,  nonfiction,  and drama. Appropriate for students from any discipline.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B244', 'Introduction to Rhetorical Theory', 'UG', NULL, 'This course acquaints students with historic and current rhetorical theory.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B250', 'Copyediting and Document Design', 'UG', NULL, '(Prerequisite: ENGL B102 with a grade of ''C'' or better) This course gives students an overview of the skills necessary to prepare texts (in a range of media) for publication: copyediting and document design. Students will learn to design texts for greater readability,  and to complete document reviews including grammar/style,  copyediting notations,  and fact-checking.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B262', 'Introduction to Technical Writing', 'UG', 3, '(Prerequisite: ENGL B102 with a grade of ''C'' or better) An introduction to the basic concepts,  processes,  and genres of technical writing. Students practice using technical writing skills to communicate specialized or technical information to non-specialist audiences. Recommended for engineers,  scientists,  and computer scientists.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B263', 'Introduction to Workplace Writing', 'UG', 3, '(Prerequisite: a grade of C or better in ENGL B102) An introduction to rhetorically-effective writing for workplace audiences,  including common workplace genres (e.g. professional emails,  reports,  and resumes) and practice in collaborative writing,  document design,  and revision.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B266', 'Professional Writing Practicum', 'UG', NULL, 'A practicum in professional writing,  allowing students to complete projects that employ skills in visual rhetoric,  writing,  editing,  proofreading,  and/or research in an on-campus workplace setting. (repeatable twice for credit)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B270', 'World Literature', 'UG', 3, 'Survey of world literature,  spanning ancient to postmodern texts.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B287', 'American Literature', 'UG', 3, 'Survey of American literature: major authors,  genres and periods. Designed for English majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B288', 'English Literature I', 'UG', 3, 'British poetry,  drama and prose from Beowulf to the 18th century. Designed for English majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B289', 'English Literature II', 'UG', 3, 'British poetry,  drama and prose from the 18th century to the present. Designed for English majors.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B290', 'Great Books of the West', 'UG', 3, 'Selected masterpieces of Western literature,  with emphasis on non-English language texts in translation which are foundational to literature in English,  including works by Homer,  Dante,  Cervantes,  Voltaire,  Goethe and Flaubert.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B291', 'Introduction to Non-Western Literature', 'UG', NULL, '{=BCMP 291} Selected masterpieces of non-Western literature. Works may range from antiquity to the present.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B301', 'Theatre History I', 'UG', 3, 'A study of the development of Western theatrical texts and practices including playwriting,  acting,  and design from ancient Greece to 1800.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B302', 'Theatre History II', 'UG', 3, 'A study of the development of Western theatrical texts and practices including playwriting,  acting,  directing,  and design from 1800 to the present.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B310', 'Reading and Performing Shakespeare', 'UG', 3, '(Prereq: ENGL B101 or B105,  and ENGL B102 or B106,  each with a C or higher.) A course about how people read and perform Shakespeare in which students read and perform Shakespeare.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B322', 'Playwriting', 'UG', 3, 'A workshop approach to playwriting that culminates in each student creating a production-ready one-act play.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ENGL', 'B380', 'Epic to Romance', 'UG', NULL, '{=BCMP 380}  Comprehensive exploration of medieval and other pre-Renaissance literature using texts representative of the evolution of dominant literary forms.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
