 ('HIST', 'B109', 'Introduction to Latin American Civilization', 'UG', 3, 'A discussion of the political,  cultural and economic forces which have conditioned the development of institutions and ideas in Spanish and Portuguese America.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B111', 'History of America from Discovery to 1865', 'UG', 3, 'A general survey of the United States from the era of discovery to the present,  emphasizing major political,  economic,  social and intellectual developments.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B112', 'History of the United States from 1865 to the Present Day', 'UG', 3, 'A general survey of the United States from the era of discovery to the present,  emphasizing major political,  economic,  social and intellectual developments.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B115', 'World History to 1500', 'UG', 3, 'HIST B115 is the first of a two-semester survey of World History from the origin of human civilizations to the advent of the modern period (1500 C.E.).  The course necessarily adopts a cross-cultural approach to the study and interpretation of the past,  including political,  intellectual,  economic and social inquiry.  BHIS 115 addresses issues of religion,  gender,  trade,  migration,  conflict and interaction between and within societies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B116', 'World History from 1500 to Present', 'UG', 3, 'HIST B116 is the second of a two-semester survey of World History from the advent of the modern period (1500 C.E.) to the present.  The course necessarily adopts a cross-cultural approach to the study and interpretation of the past,  including political,  intellectual,  economic and social inquiry.  HIST B116 addresses issues of religion,  gender,  trade,  migration,  conflict and interaction between and within societies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B300', 'The Historian''s Craft', 'UG', 3, 'Explores the nature of historical evidence,  the formulation of historical questions and the construction of historical arguments using primary and secondary materials.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B301', 'Women''s History', 'UG', 3, 'An introduction to the concepts of Patriarchy and gender and their operation over time.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B302', 'World of the Ancient Greeks', 'UG', 3, 'An examination of the political,  cultural,  and social history of ancient Greece,  from the emergence of the Polis in the eighth century to the death of Alexander in 323 BCE.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B303', 'World of the Ancient Romans', 'UG', 3, 'An examination of the political,  cultural,  and social history of ancient Rome,  from the founding of the city c. 750 BCE to the barbarian conquest in the fifth century.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B306', 'The Birth of Europe', 'UG', NULL, 'A survey of the formation and development of Europe from the fourth to the 14th centuries.  Emphasis upon the emergence of European culture and upon aspects of European prosperity after A.D. 1000.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B307', 'The Crusades', 'UG', NULL, 'Holy War and Realpolitik in Mediterranean East-West relations from the 10th to the 15th centuries with emphasis on the role of the Crusades in the cultural formation,  development and international relations of East and West.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B309', 'Age of Renaissance', 'UG', 3, 'Social,  cultural,  and artistic movements in Italy and northern Europe from the Black Death (c. 1350) to religious reforms and revolutions (c. 1520).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B310', 'Age of the Reformation', 'UG', 3, 'Ecclesiastical institutions,  religious experience and efforts at reform before Luther; career and theology of Luther; diffusion of Reformation throughout Europe; career and theology of Calvin; Catholic renewal and response.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B312', 'French Revolution and Napoleonic Era', 'UG', 3, 'The changes in France and Europe during the revolutionary period,  the Napoleonic reaction and the diffusion of revolutionary ideals.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B315', 'Introduction to Environmental History', 'UG', 3, 'A survey of the western past with the environment introduced as a significant actor and object of inquiry. Emphases include the impact of changing environments on several societies as well as changing human attitudes toward the environment.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B317', 'Contemporary Europe From World War I to World War II', 'UG', 3, 'The Great War,  revolution and reconstruction; the rise of authoritarian and totalitarian regimes and the coming of World War II.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B318', 'Europe from World War II to the Present', 'UG', 3, 'The Second World War and its origins; the Cold War; European recovery; a divided continent and Europe in the Global Era.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B320', 'The History of Great Britain to 1660', 'UG', 3, 'A survey of the political,  social,  economic and cultural development of the British Isles from Anglo-Saxon times to the Restoration of 1660.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B321', 'The History of Great Britain since 1660', 'UG', 3, 'A survey of the political,  social,  economic and cultural development of the British Isles since 1660.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B330', 'Introduction to Scottish History', 'UG', NULL, 'A survey of Scottish history with an emphasis on national identity and identity formation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B351', 'African Diaspora', 'UG', NULL, 'History of African in the America''s from 16th century to the present. Special emphasis on the experiences of Africans in South Carolina and the Sea Islands.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B352', 'Africa from 1880', 'UG', 3, 'A history of modern Africa from the time of the Imperialist scramble of the 1880s to nationalism and decolonization in the present.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B353', 'Decolonization: Colonialism and Revolution in Africa and Asia', 'UG', NULL, 'A study of the demise of European colonial empires in the nineteenth and twentieth centuries. Emphasis will be placed on th rise of nationalism among subject peoples in Africa and Asia.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B395', 'History of Human Rights', 'UG', 3, 'Do Human Rights have a history? This course focuses on the historical origins of our international human rights regime and its contemporary crisis.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B399', 'Independent Study in History', 'UG', 3, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for academic affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B401', 'The Development of The American People to 1789', 'UG', NULL, 'The founding of the English colonies,  their developing maturity,  the events leading to the Revolution and the creation of a new nation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B402', 'The New Nation,  1789-1828', 'UG', NULL, 'The founding of the English colonies,  their developing maturity,  the events leading to the Revolution and the creation of a new nation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B403', 'The Sections and The Nation,  1818-1860', 'UG', 3, 'The three cultures of East,  South and West; their interactions and the events leading to the Civil War.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B404', 'Civil War and Reconstruction,  1860-1877', 'UG', 3, 'The political,  military and social history of the War and the reorganization which followed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B407', 'United States History since 1945', 'UG', NULL, 'A survey of the political,  economic,  social and cultural developments in the period after World War II.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B409', 'The History of South Carolina,  1670-1865', 'UG', 3, 'A study of South Carolina origins and developments.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B410', 'History of South Carolina since 1865', 'UG', NULL, 'A survey of recent South Carolina history with emphasis on social and institutional development.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B415', 'Black Americans', 'UG', 3, 'A survey of the historical development of black people in the Western Hemisphere.');
