INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B420', 'Latin America: The Founding of New Societies', 'UG', 3, 'The establishment of consolidation of the Spanish and Portuguese empires in the Western hemisphere; interaction of Indians,  Africans and Iberians and the formation of social,  economic and political traditions in Latin America; political independence.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B421', 'Modern Latin America', 'UG', 3, 'Traditional society in the area and problems arising from social,  economic and political changes since independence; comparative studies of national responses to these problems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B423', 'History of Mexico', 'UG', 3, 'Mexico from the pre-conquest period to the present,  with an emphasis on modern Mexico.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B430', 'U.S. Constitutional History', 'UG', 3, '(Prereq: completion of one of the following: HIST 101,  102,  B111,  B112,  B115,  B116. Of the six,  HIST B111,  or B112 which cover U.S. history are preferred,  though not required.)United States Constitutional history including constitutional origins in English and colonial legal practices,  writing and ratifying the Constitution,  Supreme Court decisions,  and changes in constitutional interpretation the twentieth century.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B442', 'The Old South', 'UG', 3, 'Development of Southern society and of the forces that made the South a distinctive section of the United States.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B443', 'The New South', 'UG', 3, 'Reconstruction,  the Bourbon era,  agrarian revolt,  industrial revolution,  racial problems and the changes resulting from the impact of two world wars and the New Deal (1865-1946).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B468', 'American Military Experience', 'UG', 3, 'Transformation of war and of the institutions for waging war from the American Revolution to the present.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B469', 'American Legal History', 'UG', 3, '(Prereq: One of the following: BHIS  101,  102,  111,  112,  115,  116. 111 or 112 is preferred) A survey in American legal history,  themes will include but are not confined to constitutional law,  the impact of industrialism and the internationalization of law in the 20th century.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HIST', 'B492', 'Topics in History', 'UG', 3, 'Reading and research on selected historical subjects. Open only to juniors and seniors with permission of the instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B180', 'Personal an Professional Development in Human Services', 'UG', 3, '(Prereq: BPSY 101 or BSOC 101 or permission of Instructor) This course provided students with the opportunity to explore their personal and professional development and understand how values,  beliefs and norms impact both personal and professional lives.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B190', 'Human Services: An Introduction', 'UG', 3, '(Prereq: BPSY 101 or BSOC 101 or permission of Instructor). The intention of this course is to acquaint students with an overview of the interdisciplinary field of human services by providing a historical and contemporary survey of human service program literatures. Students will be able to identify the domain of human services as an interdisciplinary area of theory and practice. Specifically,  they will be able to master concepts generic to this field of study and apply them in human service situations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B280', 'Micro [Level] Human Service Interventions', 'UG', 3, '(Prerequisite or corequisite: HMSV B190 or consent of instructor) Exploration of the theories,  skills and practices of working one-on one in human services settings. Includes active listening,  communication skills,  and interviewing techniques,  the development of service plans,  crisis intervention,  short and long term care,  case management and information and referral services. Multicultural and ethical/legal issues related to this [Level] of intervention will be examined.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B282', 'Mezzo [Level] Human Services Interventions', 'UG', 3, '(Prerequisites: HMSV B280 or consent of instructor) Exploration of the theories,  skills and practice of working with small groups in human services settings. Includes understanding group dynamics,  managing and facilitating educational and prevention groups,  self-help and support groups,  and families. Multicultural and ethical/legal issues related to this [Level] of intervention will be examined.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B290', 'Human Services Internship I', 'UG', 3, '(Prerequisite: HMSV 280 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; attendance at three on-campus seminars,  or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories,  concepts and principles of practice.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B298', 'Human Services Internship II', 'UG', 3, 'BHSV 298 - HUMAN SERVICES INTERNSHIP II (3). (Prereq:  BHSV 290 or permission of Instructor) The application of theoretical foundations and human service principle in a supervised human service setting. Requires at least 120 hours of service,  attendance at an orientation session and a closing session,  on-line reflections and a final paper that demonstrates the ability to apply interdisciplinary theories,  concepts and principles of practice at a higher [Level] than in the previous internship. (N.B. no more than two internships can be at the same site.)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B300', 'Macro [Level] Human Services Interventions', 'UG', 3, '(Prerequisite BHSV 280 or permission of Instructor.) Exploration of the theories,  skills and practices of working with larger groups in human service settings such as grassroots or formal organizations,  neighborhoods,  communities,  geographic regions,  political jurisdictions,  and societies. Includes community organizing and development,  agency collaborations,  social change,  social marketing and public awareness,  advocacy and social policy work. Multicultural and ethical/legal issues related to this [Level] of intervention will be examined.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B302', 'Human Service Evaluation', 'UG', 3, '(Prereq: HMSV B280,  or permission of Instructor) Research methods for determining the effectiveness of social programs/interventions (i.e.,  experimental,  quasi-experimental and qualitative designs).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B303', 'Principles of Gerontology', 'UG', NULL, '(SOCY B303 & PSYC B303) An exploration of the interdisciplinary field of gerontology,  including the fundamental concepts,  theories,  and issues involved in the study of aging from diverse perspectives.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B400', 'Leadership and Professional Ethics in Human Services', 'UG', 3, '(Prereq: BHSV 302 or permission of Instructor) An exploration of leadership in human service settings and the essentials involved in managing information,  human resources and fiscal resources in human service agencies with an emphasis on non-profit organizations. In addition,  the course will explore professional ethics and legal issues involved in facing challenges such as privacy,  confidentiality,  informed consent,  freedom of information and information security.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B402', 'Nonprofit Management and Funding', 'UG', 3, '(Prerequisite: HMSV B400 or consent of instructor) Principles,  theories,  skills and practices of effective nonprofit management,  including the following topics: governance,  legal structures and standards,  strategic planning,  fundraising and proposal development,  volunteer management,  marketing and communication.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B490', 'Human Services Internship III and Capstone Seminar', 'UG', 3, '(Prereq: BHSV 298 or permission of Instructor) The application of theoretical foundations and human service principle in a supervised human service setting. Requires at least 120 hours of service,  attendance at and participation in four on campus seminars and a Capstone Project that demonstrates the ability to apply interdisciplinary theories,  concepts and principles of practice at a higher [Level] than in the previous internship. Students will also submit their Human Services Portfolio for final review and approval. (N.B. no more than two internships can be at the same site.)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B492', NULL, 'UG', 3, NULL);
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HMSV', 'B498', 'Selected Topics in Human Services', 'UG', NULL, '(Prereq: Permission of Instructor) Advanced readings and research on selected topics in human services. Course and content varies and will be announced in the schedule of classes by suffix and title. Topics may include: grant writing and fund development,  community development,  new clinical developments,  grassroots community organizing,  working in faith-based communities,  emergency management and disaster relief,  working with special populations,  etc.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B101', 'Basic Health', 'UG', 3, 'This course is a basic personal health course in which students will learn about strategies to improve health. Nutrition,  fitness,  drugs,  and sexuality are some of the topics discussed. Career opportunities within the health field explored.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B300', 'Transcultural Health', 'UG', 3, 'This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies,  providing a unique perspective on the implications for patient care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B310', 'Introduction to Health Promotion', 'UG', 3, 'A broad-based overview of those processes that enable people to assume responsibility for health and wellness and the role of the health promotion professional.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B315', 'Health Promotion Across the Lifespan', 'UG', 3, 'The study of age as a determinant of health and disease outcomes across the lifespan with strategies to promote wellness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B320', 'Chronic Disease and Risk Reduction', 'UG', 3, 'The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B321', 'Fundamentals of Occupational Health and Safety', 'UG', 3, 'Anintroductorycoursecoveringmajorissuesinoccupationalhealthandsafety, withanemphasisontheidentification, evaluationandcontrolofphysical, chemical, biologicalandbehavioralfactorsoftenpresentintheworkplaceandposeariskforillness, injuryanddeath.Aspeopletypicallyworkatleast40hoursperweekformostoftheiradultlives, theworkplacehasthepotentialtosignificantlyimpacthumanhealthandwellbeing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B323', 'Introduction to Exercise and Sports Science', 'UG', 3, '(Prereq: BIO243 Anatomy and Physiology I and BIO244 Anatomy and Physiology II) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B330', 'Principles of Epidemiology', 'UG', 3, 'The study of the patterns,  causes and effects of health and disease.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B340', 'Introduction of Environmental Health', 'UG', 3, 'The study of environmental factors,  be they physical,  chemical,  biological or behavioral,  that have the potential to adversely impact human and/or ecological health.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B360', 'Health Behavior and Education', 'UG', 3, 'The study of the behavioral and social factors that influence health and disease. Models of health behavior theory will be presented. Methods for preparation of health education curricula will be discussed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B370', 'Wellness in Health Promotion', 'UG', 3, 'The study of the roles of nutrition,  exercise,  hygiene and rest in the prevention of disease and the achievement of optimal health.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B380', 'Research Methods in Health Promotion', 'UG', 3, 'A course designed to impart knowledge and skills regarding the design,  implementation,  analysis and interpretation of research in the field of health promotion.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B390', 'Field Experience in Health Promotion', 'UG', 3, '(Prerequisite: HPRO B310 and Junior Status) A period of introductory work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B395', 'Global Healthcare Study Abroad', 'UG', NULL, 'Provides students the opportunity to engage in global health fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B400', 'Global Health Promotion', 'UG', NULL, 'The study of health and disease among geographically diverse populations and the role of cultural variation in determining health prevention strategies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B401', 'Health Care Delivery Systems', 'UG', 3, '{ NURS B401} Systems theory,  health care delivery systems conceptualize transitions from one [Level] of care to another,  with emphasis on ethical and legal issues; technology; historical,  political,  economic aspects to meet the health care needs of the population.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B410', 'Examining Health Inequalities', 'UG', 3, 'This course is designed to examine health disparities and associated social determinants of health in the U.S. Also included is an exploration of multi-[Level] intervention strategies for reducing health disparities.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B420', 'Leadership and Management in Health', 'UG', 3, 'This course is designed to enhance leadership and management skills needed to design,  implement and evaluate health promotion programs.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B450', 'Health Promotion Program Development', 'UG', 3, 'A study of methods used to develop effective health promotion and education programs which help enable individuals prevent,  delay and treat disease.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B460', 'Health Promotion Program Evaluation', 'UG', 3, 'A study of evaluation methods used to assess the potential impacts of health promotion programs.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B461', 'Writing Professions in the Health Professions', 'UG', 3, 'Preparation for and practice in types of writing important to those working within the health care and health promotion industry,  from brief letters to formal articles and reports.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('HPRO', 'B480', 'Internship in Health Promotion', 'UG', 4, 'A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
