 ('ISAT', 'B240', 'Introduction to Software Engineering', 'UG', 3, '{CSCI B240} (Prerequisite: ISAT B145 or consent of instructor) Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B250', 'Mobile Application Development', 'UG', NULL, '{CSCI B250} (Prerequisite: CSCI B145 with grade of C or better,  or consent.) Introduction to Mobile application development fundamentals including development platforms,  user interface design,  data persistence,  map Application Programming Interface.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B255', 'Introduction to Computational Biology', 'UG', NULL, '{CSCI B255} (Prerequisite: CSCI B104 or BIOL B101 or consent) Introduction to the Linux operating system,  an introduction to computational tools used in exploring and analyzing biological data.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B265', 'Graphics,  Multimedia and User-Interface Design', 'UG', NULL, '{CSCI B265} (Prerequisite: CSCI/MATH B280 or MATH B230,  and CSCI B145 or consent.) Principles of windowing systems; Graphical interface design and implementation; Processing graphical data using a high [Level] programming language.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B280', 'Computational Mathematics', 'UG', 4, '{CSCI B280,  MATH B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations,  diagonalization,  and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B317', 'Introduction to Digital Forensics', 'UG', 3, '{CSCI B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics,  electronic discovery,  legal issues related to digital analysis,  and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms,  including Windows,  iOS,  and Android devices.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B318', 'Ethical Hacking', 'UG', 3, '(Prerequisite: ISAT B201) Introduction to the principles and techniques associated with the cybersecurity practice known as penetration testing or ethical hacking. The course covers planning,  reconnaissance,  scanning,  exploitation,  post-exploitation,  and result reporting. The student discovers how system vulnerabilities can be exploited and learns to avoid such problems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B320', 'Database Management Systems I', 'UG', 3, '{CSCI B320} (Prerequisite: CSCI B145 or consent) Provides foundations of database systems for students with little prior database experience; topics include relational algebra,  data models,  schema design and normalization,  storage management,  query,  transaction,  concurrency control and consistency.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B321', 'Database-Driven Applications Development', 'UG', 3, '{CSCI B321} (Prerequisite: CSCI B145 and CSCI B320) Development of data-driven software for devices including smart phones,  tablets,  handheld units,  and other general purpose computing platforms. Emphasis on database connectivity,  design patterns,  human-computer interfaces and usability.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B350', 'Introduction to Data Structures and Algorithms', 'UG', 3, '{CSCI B350} (Prerequisite: CSCI/MATH B280 [or MATH B230 and MATH B242],  and CSCI B146 or consent) Core techniques in the scientific computing process; the focus is on numerical methods,  data structures,  and computing optimization.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B365', 'Computer Graphics', 'UG', 3, '{CSCI B365} (Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing,  clipping,  lighting,  and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B399', 'Independent Study', 'UG', NULL, '{CSCI B399} (Prerequisite: Contract approval is required).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B401', 'Information Security Principles', 'UG', 3, '(Prerequisite: CSCI B201) This course extends fundamental computer security concepts,  practices,  and issues,  introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention,  detection,  and response tools and approaches; risk and risk assessment; human factors in information security; legal,  ethical,  and professional issues.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B409', 'Special Topics in Security', 'UG', 3, '(Prerequisite: Consent of instructor) Intensive study of a particular topic in computing security,  information security,  or other aspects of cybersecurity. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B416', 'Introduction to Computer Networks', 'UG', 3, '{CSCI B416} (Prerequisite: CSCI B145 or consent) Fundamental concepts in computer networks,  protocols,  and applications. Topics include: network architectures,  transmission media,  protocols,  wireless networks,  routing,  security and latest topics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B420', 'Database Management Systems II', 'UG', 3, '(Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure,  function,  and package implementation; trigger creation and usage; query optimization techniques; security considerations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B422', 'Introduction to Data Mining', 'UG', 3, '{CSCI B422} (Prerequisite: MATH B230 or CSCI/MATH B280,  STAT B340 and CSCI B320) Introduction to information processing techniques and mathematical tools to assemble,  access,  and analyze data for decision support and knowledge discovery.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B426', 'Special Topics in Computer Networks & Distributed Computing', 'UG', NULL, '{CSCI B426} (Prerequisite: CSCI B416) Advanced topics in Computer Networks,  course content varies and will be announced in the schedule of classes by suffix and title. May be repeated under different topics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B437', 'Information Technology Project Management', 'UG', 3, '(Prerequisite: CSCI/ISAT B207 and MGMT B371,  or consent of instructor) This course introduces students to project management concepts,  techniques,  and tools used by project managers to plan,  initiate,  manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope,  cost,  people,  expectations,  risk,  communications,  and procurement; agile methodologies; project management software.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B450', 'Modeling and Simulation', 'UG', 3, '{CSCI B450} (Prerequisite: CSCI B350 or consent,  and STAT B340) An introduction to modeling and simulation. Topics include fundamental techniques in designing,  coding,  and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B469', 'High Performance Computing', 'UG', 3, '{CSCI B469} (Prerequisite: CSCI B104 or CSCI B145,  MATH B230 or CSCI/MATH B280,  and CSCI B150) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B470', 'Software System Process & Management', 'UG', 3, '{CSCI B470} (Prerequisite: CSCI B350 or consent) Testing theory and techniques for software systems; software development process,  specification,  black-box and white-box testing,  configuration and compatibility testing,  usability testing,  quality assurance,  testing planning,  and documentation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('ISAT', 'B499', 'Computer Science Co-Op/Internship', 'UG', NULL, '{CSCI B499} (Prerequisite: Computational Science major or consent of instructor) Practical full-time work experience in an area of Computational Science,  selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit,  45 minimum internship work hours required; for 2 credits,  90 work hours,  and for 3 credits,  135 work hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LANG', 'B101', 'Integrated Linguistic Skills for Native Speakers I Integrated Linguistic Skills Native Speakers I', 'UG', NULL, 'Introduction to foreign language linguistic skills (beginning [Level] 1) with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LANG', 'B102', 'Integrated Linguistics Skills Native Speakers II', 'UG', NULL, 'Continuation (beginning [Level] 2) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LANG', 'B201', 'Integrated Linguistic Skills Native Speakers III', 'UG', NULL, 'Continuation (intermediate [Level] 1) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B250', 'Liberal Studies Internship', 'UG', 3, 'Provides students with the opportunity to apply interdisciplinary research skills across culturally diverse populations in a professional setting. Minimum requirement of 150 service hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B260', 'Introduction to Medical and Health Humanities', 'UG', 3, 'An interdisciplinary course designed for students to focus on the broadly encompassing field of health and medicine from the perspective of the humanities.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B297', 'Interdisciplinary Research Methods', 'UG', NULL, '(Prerequisite: 45 hours of General Studies and acceptance Interdisciplinary Major and Minor Programs). Introduction to individualized study including initial development or course of study proposal,  review of courses,  and bibliography.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B305', 'Integrated Liberal Studies I', 'UG', 1, 'Students identify two courses in two different disciplines that have a correlative relationship beneficial to students course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours. (pre-requisite: LBST 297; permission of instructor)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B330', 'Cultural Historiography', 'UG', NULL, 'Intensive interdisciplinary study of selected topics regarding cultural history with empirical research component. Open to all majors. Can be repeated up to two time (6 credit hours). Topic reflected in section number. Maymester only.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B331', 'Topics in Cultural Historiography', 'UG', 3, '(Prerequisite: ENGL B101 or B105,  and B102 or B106,  each with a grade of C or higher)  Intensive interdisciplinary study of selected topics regarding cultural history. Open to all majors. Can be repeated up to two times (6 credit hours). Topic reflected in section number.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B351', 'Beyond the Classroom: Community Project I', 'UG', 3, 'Explores foundations of service learning. Theoretical approach to design and implementation of service learning project in and around the university,  with emphasis on community outreach.  Pre-requisite:  LBST major or approval of instructor. Junior standing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B352', 'Beyond the Classroom: Community Project II', 'UG', 3, 'The application of theoretical foundations and service learning in an a community project designed in LBST 351,  implemented as individual or group project.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B363', 'Philosophy of Film', 'UG', NULL, '{PHIL B363}  (Prerequisite: ENGL B101/B105 and ENGL B102/B106)  Interdisciplinary course with emphasis on topical study of film theory,  the aesthetics of film as an art form,  the social impact and relevance of film.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B397', 'Readings in Philosophy', 'UG', 3, '(=PHIL B397) (PREREQ: junior standing and completion of  General Education English and Humanities requirements) A systematic study of a primary source in philosophy having relevance to other disciplines.  Can be conducted as a small course or as a tutorial.  May be taken twice for credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B399', 'Independent Study', 'UG', NULL, '(Prerequisite: Contract approval is required.)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B405', 'Integrated Liberal Studies II', 'UG', 1, 'Students identify two courses in two different disciplines that have a correlative relationship beneficial to students course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours.  Pre-requisite: LBST 297; permission of instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B439', 'Selected Topics', 'UG', NULL, '(Prerequisite: ENGL B102 or B106 with a grade of "C" or higher) Intensive interdisciplinary study of selected themes or topics as defined by title. May be repeated for credit under a different topic title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LBST', 'B497', 'Seminar in Liberal Studies among the Disciplines', 'UG', 2, 'Prereq: Senior standing in Liberal Studies or consent of the instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LING', 'B385', 'Gender and Language Use', 'UG', NULL, '{=ANTH 385}  The course will explore an approach to gender and language use that emphasizes the grounding in social practice of both.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('LING', 'B431', 'Development of the English Language', 'UG', NULL, '{=ENGL 453}  English from Indo-European through Germanic and Old English,  Middle English and Modern English. No previous knowledge of Old English or Middle English is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B102', 'Media Design', 'UG', 3, 'Fundamental conceptual and technical aspects of designing popular media,  including an introduction to digital compositing,  time-based media,  and interactive media.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B145', 'Digital Imaging', 'UG', 3, 'Foundations class on the aesthetic and communicative elements of digital image production,  including 2D computer graphics,  3D motion graphics,  and coding for media designers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B201', 'History of Animation in the US', 'UG', 3, '{ ARTH B201} A survey of popular animation in the United States,  from early 20th century film to contemporary digital media,  with an introduction to animation techniques using computer software.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B210', 'Digital Animation 1', 'UG', 3, 'Introduction to the theory and practice of using computer software to create animated digital media,  including 3D character animation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B250', 'Broadcast Design 1', 'UG', 3, 'Introduction to the design and production of media for documentary style broadcasting,  including storyboarding,  virtual sets,  digital cinematography,  video editing,  and motion graphics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B281', 'Video Game Design 1', 'UG', 3, 'Introduction to the theory and practice of using computer software to design interactive digital media,  including a first-person 3D video game.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B310', 'Digital Animation 2', 'UG', 3, '(Prerequisite: MART B210) Intermediate project-based course on a specialized aspect of digital animation production,  including 3D modeling,  character animation,  or special effects.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B350', 'Broadcast Design 2', 'UG', NULL, 'Intermediate course on a specialized aspect of designing digital media for a documentary style television broadcast,  such as virtual sets,  digital cinematography,  3D motion graphics,  or special effects.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B375', 'Digital Fabrication', 'UG', NULL, 'An introduction to emerging technologies relating to rapid prototyping processes,  this course focuses on three-dimensional printing and other computer controlled technologies pertaining to the design and fabrication of a sculptural object and/or design.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B380', 'New Media Art', 'UG', 3, 'Introduction to the design and development of new media art,  including internet-based art,  media performance,  installation,  and interactivity.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B381', 'Video Game Design 2', 'UG', 3, '(Prerequisite: MART B281) Intermediate project-based course on a specialized aspect of 3D video game production,  including art assets,  [Level] design,  or coding events.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B385', 'Emerging Technologies', 'UG', NULL, 'This course focuses on the use of hardware and software to create artwork that has elements of interactivity,  time-based functionality and code manipulation.  Other topics include: DIY movements,  microprocessors,  and installation art.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B410', 'Narrative Media', 'UG', 3, 'MART B410 - NARRATIVE MEDIA (3). Advanced project-based course on telling a story through moving pictures,  including taking a script through the 3D production process to a festival quality short animation.  Pre-requisite: MART B310 or permission of instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B481', 'Performative Media', 'UG', 3, 'Advanced project-based course on the design and practice of media performance,  including the development of interactive virtual characters and environments for a live stage production.  Pre-requisite: MART B381 or permission of instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MART', 'B499', 'Internship in Media Arts', 'UG', NULL, 'Supervised experience in media production facilities. Can be taken for 1-3 credits based on 50 contact hours per credit,  and contract must be approved by instructor,  advisor,  and department head.  Pre-requisite: Signed contract and,  MART B310 or B381 or permission of instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B101', 'Experiential Mathematics and Computation', 'UG', 3, '(Prereq. Mathematics Placement Exam and two years of high school algebra or equivalent) Mathematics application and appreciation in algebra,  geometry,  probability and statistics. Modeling and computation in practical applications. Foundational topics are chosen from: Number and Measurement Systems,  Symbolic Relationships,  Data Description or Analysis,  Geometry,  Uncertainty,  Reasoning,  and the Mathematics of Finance. This course serves as a prerequisite for no other BMTH courses.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B111', 'College Algebra', 'UG', 3, '(Prereq: qualification through placement) Basic college algebra; linear and quadratic equations,  inequalities,  functions and graphs of functions,  exponential and logarithmic functions,  systems of equations. Credit may not be received for both MATH B111 and B111L.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B111E', 'College Algebra Extension', 'UG', 1, 'Basic college algebra; linear and quadratic equations,  inequalities,  functions and graphs of functions,  exponential and logarithmic functions,  systems of equations. This extension lab provides supervised practice of skills necessary for proficiency in college-[Level] algebra. Required for enrollment in MATH B111 without an appropriate score on the Mathematics Placement Exam.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B111L', 'Intensive College Algebra', 'UG', 4, '(Prereq: qualification through placement) Basic college algebra; linear and quadratic equations,  inequalities,  functions and graphs of functions,  exponential and logarithmic functions,  systems of equations. Course taught in intensive 3 hours and 45 minute per week format. Credit may not be received for both MATH B111L and B111.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B115', 'Precalculus Mathematics', 'UG', 4, '(Prereq: qualification through placement or a grade of C or better in 111 or 111L) Topics in algebra and trigonometry specifically needed for BMTH 141,  142,  240. Polynomial,  rational,  inverse,  logarithmic,  exponential functions;  circular functions; analytic trigonometry.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B122', 'Calculus for Business Administration and Social Sciences', 'UG', 3, '(Prereq: qualification through placement or a grade of C or better in BMTH 111/111L or consent) Derivatives and integrals of elementary algebraic,  exponential and logarithmic functions. Maxima,  minima,  rate of change,  and area under a curve. Applications include marginality and elasticity of demand.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B131', 'Introductory Mathematics for Comutational Science', 'UG', NULL, '(Prereq: Qualification through placement or a grade of C or better in BMTH 111/111L or consent) Sets,  functions,  analytic geometry,  matrices and Euclidean spaces,  infinites series,  approximation,  precision and error,  counting and probability,  graphs and trees; fundamental notions of differential and integral calculus.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B141', 'Calculus I', 'UG', 4, '(Prereq: qualification through placement or a grade of C or better in BMTH 115) Introduction to fundamental concepts and theorems of limits,  continuity,  and derivatives; rates of change; differentiation rules for algebraic and transcendental functions,  including the chain rule; applications of derivatives; introduction to integration,  including the Fundamental Theorem of Calculus and u-substitution; areas between curves.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B142', 'Calculus II', 'UG', 4, '(Prereq: qualification through placement or a grade of C or better in MATH B141) Techniques of integration,  applications of the integral,  LHospitals Rule,  improper integrals; sequences and series of real numbers,  power and Taylor series,  introduction to polar coordinates.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B170', 'Finite Mathematics', 'UG', NULL, '(Prereq: qualification through placement or a grade of C or better in BMTH 111,  111L,  or 115) Elementary matrix theory; systems of linear equations; permutations and combinations; probability and Markov chains; linear programming and game theory.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B172', 'Mathematical Modeling for the Life Sciences', 'UG', 3, 'Modeling with difference equations; vectors,  trigonometry,  polar coordinates,  matrices,  eigenvalues and eigenvectors; addition and multiplication in combinatorics,  permutations,  combinations,  introduction to probability theory (discrete,  continuous); techniques of integration,  symmetry. Credit may not be received for both BMTH 172 and either BMTH 170 or 174.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B174', 'Discrete Mathematics for Computer Science', 'UG', 3, '(Prereq: qualification through placement or a grade of C or better in BMTH 115) Induction,  complexity,  elementary counting,  combinations and permutations,  recursion and recurrence relations,  graphs and trees; discussion of the design and analysis of algorithms with emphasis on sorting and searching.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B221', 'Basic Concepts of Elementary Mathematics', 'UG', 3, '(Prerequisite: Qualification through placement or a grade of C or better in MATH B111,  B111L,  or B115) The meaning of number,  fudametal opertions of arithmetic,  the structure of the real number system and its subsyems,  elementary number theory. Open only to students in elementary or early childhood teacher certification.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B222', 'Basic Concepts of Elementary Mathematics II', 'UG', 3, '(Prereq: MATH B221) Informal geometry and basic concepts of algebra. Open only to students in elementary or early childhood teacher certification.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B230', 'Linear Algebra', 'UG', 3, '(Prereq: MATH B141 or consent of instructor) Linear systems and matrices,  vector spaces,  linear independence,  rank of a matrix,  linear transformations,  determinants,  introduction to eigenvalues and eigenvectors,  diagonalization and applications.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B240', 'Calculus III', 'UG', 4, '(Prereq: qualification through placement or a grade of C or better in MATH B142) Parametric equations,  polar coordinates,  three dimensional analytic geometry,  cylindrical and spherical coordinates,  vector functions,  functions of several variables,  partial differentiation,  max-min,  Lagrange multipliers,  multiple integrals and applications,  integral vector calculus.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B242', 'Elementary Differential Equations', 'UG', 3, '(Prereq: qualification through placement or a grade of C or better in BMTH 142) Ordinary differential equations of first order,  higher order linear equations,  Laplace transform methods,  series methods; numerical solution of differential equations. Applications to physical sciences and engineering.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B280', 'Computational Mathematics', 'UG', 3, '{=BCSE 280} (Prereq: BMTH 142 and BCSE 104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations,  diagonalization,  and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B300', 'Introduction to Proof', 'UG', 3, '(Prerequisite: Grade of ''C'' or better in MATH B142) Introduction to the language and nature of reasoning,  structure,  and technique as they apply to advanced mathematics and proofs. Topics include logic,  set theory,  cardinality,  and methods of proof (including induction).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B331', 'Foundations of Geometry', 'UG', 3, '(Prerequisite: Grade of ''C'' or better in MATH B300) The study of geometry as a logical system based upon postulates and undefined terms. The fundamental concepts and relations of Euclidean geometry developed rigorously on the basis of a set of postulates. Some topics from non-Euclidean geometry.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B399', 'Independent Study in Mathematics', 'UG', NULL, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for Academic Affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B401', 'History of Mathematics', 'UG', 3, '(Prerequisite: C or better in MATH B122 or MATH B141) A study of the historical development of mathematics focusing on conceptual milestones.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B410', 'Abstract Algebra I', 'UG', 3, '(Prerequisite: A grade of C or better in both MATH B230 and MATH B300 or consent of the department) An introduction to algebraic structures. Introduction to group theory including subgroups,  quotient groups,  homomorphisms; introduction to rings including ideals,  quotient rings,  polynomial rings and fields of fractions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B411', 'Abstract Algebra II', 'UG', 3, '(Prerequisite: A grade of C or better in MATH B410)  A continuation of studies in Algebra. An introduction to modules and field theory including  vector spaces,  algebras  and  free abelian  groups;  introduction to field theory  including  algebraic  extension,   Galois theory and finite fields.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B419', 'Mathematical Modeling', 'UG', 3, 'MATH B419- MATHEMATICAL MODELING (4).  { CSCI B419} (Prerequisite: C or better in MATH B142 and CSCI B104 or consent) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B421', 'Mathematics for Secondary Teachers', 'UG', 3, '(Prereq: Admission to professional program in education) Survey of properties and algebra of real numbers and complex numbers; properties and representations of various functions; concepts of calculus; Euclidean and non-Euclidean geometries; applications of probability,  data analysis,  and discrete mathematics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B427', 'Numerical Analysis', 'UG', 3, 'Interpolation and approximation of functions; solution of algebraic equations; numerical differentiation and integration; numerical solutions of ordinary differential equations and boundary value problems; computer implementation of algorithms.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B450', 'Analysis I', 'UG', 3, '(Prerequisite: C or better in MATH B300 or permission of the instructor) A rigorous treatment of topics introduced in elementary calculus and more advanced topics basic to the study of real analysis.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B451', 'Analysis II', 'UG', 3, '(Prerequisite: A grade of C or better in MATH B450 or consent of the department) An introduction to the theory of several variables calculus: convergence in Euclidean spaces,  functions on Euclidean spaces,  differentiation in several variables,  integration in several variables.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B452', 'Complex Analysis', 'UG', 3, '(Prerequisite: Grade of C or better in MATH B240) Complex integration,  calculus of residues,  conformal mapping,  Taylor and Laurent series expansions,  applications.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B460', 'Topology', 'UG', 3, '(Prerequisite: C or better in MATH B300 or permission of the instructor) Topological spaces and homeomorphisms; separability; compactness; connectedness; completeness; metrizability; introduction to homotopy theory.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B480', 'Senior Seminar', 'UG', 3, 'A review of current literature in specified subject areas involving student presentations. Content varies and will be announced in the schedule of classes by suffix and title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B497', 'Reading for Senior Thesis', 'UG', NULL, '(Prerequisite: Junior Standing with a GPA of 3.0 or higher within Mathematics major and Departmental Approval) Directed reading in preparation for senior thesis in literature.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MATH', 'B499', 'Senior Thesis', 'UG', NULL, '(Prerequisite: MATH B97) The senior thesis provides a capstone experience for Mathematics majors. Students will work independently and with the professor to complete a substantial expository or research project.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B300', 'Careers in Business', 'UG', NULL, 'An introduction to career opportunities and the career placement process in business.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B355', 'Introduction to Health Care Management', 'UG', 3, '(Prerequisite: Junior Standing) This course will provide students with the opportunity to develop a general understanding of the health care industry and managerial and organizational aspects of health care organizations. Students will learn to apply management concepts,  processes,  and theoretical ideas in addressing management problems in health care organizations and in the operation of health care systems. Course activities will enable students to learn the importance of identifying and managing finite resources,  complying with ethical and legal standards,  and recognizing tradeoffs between patient care and financial accountability.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B371', 'Principles of Management and Leadership', 'UG', 3, 'A comprehensive survey of the basic principles of management and leadership applicable to all forms of business. The course provides the student with a basis for thinking about complex business situations in the framework of analysis of the management and leadership process.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B374', 'Human Resource Management', 'UG', 3, 'A development of an understanding of personnel administration as a staff function through a study of modern-day concepts and practices. Topics include: research and standards,  employment,  training and education,  safety and health,  employee services and industrial relations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B376', 'Organization Behavior', 'UG', 3, 'A study of the process of integrating people a work situation that motivates them to work together productively,  cooperatively and with economic,  psychological and social satisfaction.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B378', 'Labor Relations', 'UG', NULL, '(Prereq: Junior standing) A study of the development and methods of labor unions and employee associations in organization. Labor disputes,  collective bargaining techniques,  contents of contracts and public policies are analyzed from the standpoints of economics and law. Topics covered in detail include employee representation,  company unions,  strikes,  boycotts,  lockouts and trade agreements.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B380', 'Employment Law', 'UG', 3, 'This course surveys the laws that govern the employment relationship between employers and employees including employment-at-will,  contractual arrangements,  discrimination,  compensation,  employee safety and health and privacy protections. Labor law is covered briefly so that it can be understood in the context of other employment law.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B390', 'Management Information Systems', 'UG', 3, '(Prereq: BMGS B290 or satisfactory completion of Computer Applications Proficiency Exam) A study of the concepts,  interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems,  collecting and processing data,  reporting results of operations and controlling the business organization.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B401', 'Topics in  Entrepreneurship', 'UG', NULL, 'Relevant selected issues and topics of interest in management. Issues and concepts of the business world are explored with film profiles,  case histories and readings.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B403', 'Leadership in Organizations', 'UG', 3, 'Reviews research and practice in organizational leadership; provides students with self-assessment,  developmental exercises and case studies to prepare for leadership roles.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B404', 'Pay,  Rewards,  and Compensation Management', 'UG', 3, 'An examination of how organizations use pay and other types of rewards (both intrinsic and extrinsic) to affect employee motivation and behavior.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B405', 'Staffing,  Training and Development', 'UG', 3, 'An examination of how organizations can improve workforce quality by making effective use of recruiting and selection processes. Attention is also given to the training and development of new hires and to legal issues that surround the staffing process.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B411', 'International Management', 'UG', NULL, '(Prereq: Junior standing) This course will apply the basic principles of management and leadership to the firm operating internationally. Emphasis is placed on the management functions of leading,  planning,  organizing and controlling,  as well as the conduct of labor relations,  within the framework of a multicultural environment.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B473', 'Management and Operations of Small Business', 'UG', 3, 'Analysis of the management and operations of a small business. The course includes the study of an existing small business. The areas of management,  finance,  marketing and credit as they apply to a small business are studied.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B474', 'Advanced Management of Human Resources', 'UG', NULL, 'This course covers in detail topics from BMGT 374.  Involves students in problem-solving activities and in-depth analysis of cases,  using concepts from BMGT 374 and 376.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B475', 'Operations and Supply Chain Management', 'UG', NULL, 'A study of the strategic,  operating and control decisions involved in manufacturing and service organizations. Topics include forecasting,  process development,  production technology,  resource allocation,  facility planning,  facility layout,  planning systems,  inventory systems,  resource requirements planning systems,  shop floor planning,  scheduling operations,  just-in-time manufacturing,  materials management,  productivity control,  quality management,  quality control,  project management and lean Six Sigma.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B476', 'Supply Chain Management: A Logistics Perspective', 'UG', NULL, 'A strategic managerial emphasis that combines strategy.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B477', 'Organization Theory', 'UG', NULL, 'A conceptual framework for the orderly analysis of management functions through studies in organization planning and control theories.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B478', 'Strategic Management', 'UG', 3, 'A study of the strategic management process and of the formulation and application of functionally integrated business policy by top management. Emphasis is on decision-making in the face of changing conditions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B488', 'Business SImulation', 'UG', NULL, 'This course is designed to integrate multiple areas of specialization within a simulated business environment. Students will have the opportunity to formulate,  develop,  and implement strategic issues and concepts for a "simulated" company.  Students will also apply strategic knowledge to financial markets as a means to understand the interaction of various market variables.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGMT', 'B498', 'Strategic Human Resource Management', 'UG', 3, 'A comprehensive analysis of strategic Human Resource Managements participation in the strategic planning process.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGSC', 'B290', 'Computer Information Systems in Business', 'UG', 3, 'Concepts and techniques of business problem solving using microcomputers. Introduction to the PC operating environment,  basic information system concepts and spreadsheet,  presentation,  database and word processing software.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MGSC', 'B390', 'Management Information Systems', 'UG', 3, 'A study of the concepts,  interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems,  collecting and processing data,  reporting results of operations and controlling the business organization.  (Prerequisite: MGSC B290 or satisfactory completion of Computer Applications Proficiency Exam)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B350', 'Principles of Marketing', 'UG', 3, 'Principles and concepts underlying marketing functions,  including the conception,  pricing,  promotion and distribution of products and services and the role of marketing in society.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B352', 'Introduction to Marketing Research', 'UG', 3, 'Investigates the theory and practice of marketing research with emphasis on the problem-oriented nature of marketing research and how research activities are implemented by marketing researchers and used by managers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B453', NULL, 'UG', 3, 'This course is intended to provide the student with an understanding of the fundamentals of sales management including the recruitment,  training,  motivation,  compensation and evaluation of a sales force.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B454', 'Marketing Communications and Strategy', 'UG', 3, 'Integration of advertising,  sales promotion,  and point-of-purchase communications toward the goal of enhancing brand equity.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B455', 'Consumer Behavior', 'UG', 3, 'The principal objective of study is the consumer decision process as examined in a marketing context.  Selected concepts from psychology,  sociology,  anthropology and behavioral disciplines are analyzed to develop the student''s ability to understand and predict reactions of consumers to marketing decisions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B457', 'Personal Selling and Sales', 'UG', NULL, 'This course is a comprehensive survey of the basic process of personal selling and sales management applicable to all forms of business.  The course is intended to provide the student with a basis for developing personal selling skills as well as understanding the fundamentals of sales management.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B465', 'Marketing Strategy and Planning', 'UG', 3, 'Management of marketing organizations and integration of functions,  with emphasis on planning and designing strategies and applying tools and techniques for problem solving and decision making.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MKTG', 'B474', 'Sports Marketing', 'UG', 3, '(Prerequisite: MKTG B350) A study of promotion,  sales,  and sponsorship strategies utilized in both the marketing of sports (events and properties) and marketing through sports (building brands via alignment with a sports property).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B101', 'Introductory Oceanography I', 'UG', NULL, '(Prereq: science,  engineering,  or education major or consent of instructor) Origin and evolution of the oceans,  plate tectonics,  ocean circulation,  waves and tides,  chemical composition and primary productivity. Three lecture and three laboratory hours per week. Scheduled field trips required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B102', 'Oceanography II', 'UG', NULL, '(Prereq: science,  engineering,  or education major or consent of instructor) Origin,  evolution and diversity of marine life,  biological production,  trophic dynamics,  nutrient cycles,  marine resources and environmental concerns. Three lecture and three laboratory hours per week. Scheduled field trips required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B111', 'Evolution of the Marine Environment', 'UG', NULL, 'Origin/evolution of the earth,  seas and life over geologic time; fundamental processes of plate tectonics,  evolution and genetics. Three lecture and two laboratory hours per week. Scheduled field trips are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B112', 'Processes in the Marine Environment', 'UG', NULL, 'Study and analysis of interacting abiotic and biotic processes determining the nature and functioning of the marine environment. Three lecture and two laboratory hours per week. Scheduled field trips are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B210', 'Oceans and Society', 'UG', 4, 'A non-technical introduction to the oceans: organisms,  systems and the physical and chemical characteristics.  Laboratories illustrate the structure and function of marine environments.  Two laboratory hours per week.  Attendance on field trips may be required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B215', 'Coastal Environments of the Southeastern', 'UG', 3, 'Coastal zones of South Carolina and neighboring states,  including geologic history,  geomorphology,  stratigraphy,  hydrogeology,  shoreline processes,  environmental issues and effect of man. Three lecture hours each week plus optional field trips. Not available for marine science major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B215L', 'Coastal Environments of the Southeastern U.S. Laboratory', 'UG', 1, 'Exercises examining coastal ecology,  geomorphology,  hydrogeology,  shoreline processes,  environmental issues and human impact. Two laboratory hours per week. Scheduled field trips required. Not available for marine science major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B311', 'Biology of Marine Organisms', 'UG', NULL, '(Prereq: BBIO 112) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MSCI', 'B398', 'Advanced Topics in Marine Science', 'UG', NULL, 'Study of a topic not otherwise available to student.  May involve reading assignments,  tutorial,  lectures,  papers,  presentations,  or field or laboratory study,  determined in consultation with instructor.  Repeatable to a maximum of 8 credit hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MUSC', 'B110', 'Introduction to Music', 'UG', 3, 'Perceptive listening and appreciation of musical elements,  forms and style periods,  including composers lives,  individual styles and representative works. Emphasis on classical music; jazz and American popular music included.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MUSC', 'B124', 'Symphonic Band', 'UG', NULL, 'Musical organizations are open to all university students by audition.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MUSC', 'B129', 'University Chorus', 'UG', 1, 'Musical organizations are open to all university students by audition. May be repeated for up to 8 credits. Course may not be used to fulfill GE requirement.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MUSC', 'B130', 'Sound Design', 'UG', NULL, 'Theory,  Harmony,  Form and Analysis,  Writing,  Choral,  (SATB),  Piano/vocal,  Ensemble scores. Acoustics,  Sound Reproduction (Attack,  Sustain Decay,  Amplitude,  Frequency,  Compression,  Reverb). Engage students with basic concepts of music using current software applications.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('MUSC', 'B140', 'Jazz and American Popular Music', 'UG', 3, 'Development of jazz and American popular music through the study of important soloists,  ensembles,  arrangers and composers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B100', 'Nursing Honors Seminar', 'UG', 1, 'This honors course is designed to provide students the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meetings and planned excursions will facilitate scholarly exploration of the practice of nursing,  with an emphasis on the factors influencing current and future nursing practice. May be repeated for up to 4 credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B101', 'Nursing Honors Seminar II', 'UG', 1, 'This honors course is designed to provide students with the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meeting and planned excursions will facilitate scholarly exploration of the scope of practice including direct care roles and indirect care roles of the nurse and their influence on health policy and the health of populations across the nation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B105', 'Concepts,  Communications,  and Calculations', 'UG', NULL, 'This course introduces concepts essential to basic nursing practice. Nursing''s historical evolution as a profession through theory,  concept and role development will be presented. An overview of medical terminology and medication calculations is provided as rudimentary skills that promote effective interpretation and communication within the health disciplines,  and the mathematical calculations required to adminster pharmaceutical agents.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B200', 'Nursing Honors Seminar III', 'UG', 1, 'This honors course is designed to provide students the opportunity to explore the changing role of nursing across the globe. Seminar meetings and planned excursions will facilitate scholarly exploration of nursing practice,  comparing and contrasting nursing practice in developed and developing countries with the United States. Emphasis is placed on the the social determinants of health that influence disease prevention and health.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B201', 'Nursing Honors Seminar IV', 'UG', 1, 'This honors course is designed to provide students the opportunity to explore the changing role of nursing to improve the health of others. Through seminar meetings and experiential learning,  students will pursue a scholarly exploration of the healthcare system and health needs of populations at the regional,  state,  national or international [Level],  culminating in a service-learning project focused on the leading health indicators of the Centers for Disease Control and Prevention (CDC) Healthy People 2020');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B202', 'Decision-Making in Concept Based Care', 'UG', NULL, '(For the pre-licensure track: Prerequisite: Acceptance as a pre-licensure BSN student; Co-requisite: NURS B310 and NURS B312) The nursing process as a problem-solving framework is introduced to identify,  treat,  evaluate and document clinical problems in health records. Emphasis is placed on patient- and family-centered therapeutic communication as an adjunct to assessment and evaluation. Selected universal concepts reflecting the holistic nature of caregiving across settings are presented to advance critical thinking.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B202C', 'Clinical Care & Introduction to Nursing Techniques', 'UG', 3, 'This course emphasizes how to perform common nursing procedures. Techniques and skill development are practiced ensuring patient confidentiality,  comfort measures and pain management,  dietary restrictions/ intake and output measurement,  infection control,  vital signs,  body mechanics/safety,  concepts of self-care/hygiene,  mobility and transfer,  basic lab collection and interpretation of lab values commonly used in practice settings.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B300', 'Sex,  Sexuality,  Gender and Healthcare', 'UG', 3, 'This course presents issues of sex,  sexuality,  and gender (SSG) that health care professionals will encounter.  Students will learn the impact of sex,  sexuality and gender in the context of healthcare.  Disparities of health issues will be discussed from the continuum of health care practice,  from education,  through diagnosis,  to treatment and response.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B301', 'Role Development in Nursing', 'UG', 3, '(Prerequisite: Acceptance the RN to BSN Program and current RN licensure or consent of the instructor) Overview of the historical aspects of professional nursing and the impact this history has on current day nursing practice. Emphasizes the development of nursing as a profession including scholarship,  theories,  advanced practice and leadership. Presents emotional intelligence as a construct linked to effective leadership and interdisciplinary team relationships.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B303', 'Health & Wellness Innovation: Creative Inquiry', 'UG', NULL, '{PUBH B303} (Prerequisite: NURS B350) The purpose of this course is to introduce and encourage health professional-driven innovation. This course equips students with an empathetic mindset to see healthcare and public health issues from the perspective of the person who is experiencing the challenge. Students will develop new and creative ways to improve health and well-being.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B305', 'Spirituality,  Health,  and Health Professions', 'UG', 3, 'Exploration of spirituality,  its effect on health,  and health professionals roles in the spiritual care of clients.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B310', 'Pathophysiology', 'UG', 3, '(Prerequisite: Acceptance to the Pre-licensure or RN to BSN Program or consent of Instructor) Building on prior science courses,  this course advances knowledge of pathophysiology by analyzing the molecular,  cellular and organ system changes that occur with common diseases,  noting their impact on total body function and homeostasis. Focus is on the mechanisms of underlying diseases needed to deliver preventive and therapeutic health care interventions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B312', 'Assessment and Physical Examination of Individuals', 'UG', 3, '(Prerequisite: Acceptance to the Pre-licensure program,  RN licensure or consent of instructor).  Students will conduct a systematic patient examination to determine the health,  health risk,  and health alterations from the disease conditions. The focus is on adults with normal physiologic variation and extends to include age,  gender,  and socio-cultural variants. Using assessment findings students will derive clinical problem statements,  determine risk reduction strategies,  and align assessment findings with laboratory and other diagnostic results to create a comprehensive health profile.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B320', 'Clinical Pharmacology', 'UG', 3, '(Prerequisite: NURS B310 or consent of instructor) This course provides an overview of the chemical therapeutic measures which assist patients in reducing the physical and emotional effects of illness and in improving or promoting health. Focus is on the mechanism of action of these interventions as they affect underlying physiological and pathophysiological processes (Lecture 3 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B325', 'Nursing Informatics and Technology in Healthcare', 'UG', NULL, '(Prerequisite: NURS B202 or B301) This course introduces nursing informatics and patient care technologies utilized in healthcare settings. Students explore informatics and technology from identification,  retrieval,  processing,  evaluation,  and management of healthcare technology and information systems intended to improve patient outcomes and reduce risk of harm. Legal and ethical considerations related to these technologies are examined. Emphasis is placed on selected technologies and evaluating how they impact nursing practice and influence quality and safety across the continuum of care. Basic computer literacy is a pre-requisite to support success.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B326', 'Adult Health Nursing I', 'UG', NULL, '(Prerequisite: NURS B202,  B310 and B312; Co-req. NURS B320). This course includes information on common chronic and acute illnesses including pre- and post-operative preparation. A nursing process approach outlines nursing actions for major common illnesses in the hospital setting.  Intermediate nursing skills are taught in the laboratory and applied in the clinical area. Students learn how to provide appropriate nursing care to patients with common health problems and patients requiring surgery (Lecture 3 hours,  Laboratory 3 hours,  Clinical Experience 6 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B326C', 'Clinical Care of Adults with Acute and Chronic Conditions', 'UG', 3, '(Prerequisite: NURS B202,  B202C,  B312; Corequisite: NURS B320 & B326) Students will be exposed to adults and older adults with acute and chronic conditions. Clinical experiences will focus on the application of knowledge and skills related to the care of an adult patient. Emphasis will be placed on applying the nursing process to manage care,  setting clinical priorities and using technology to anticipate patient needs as a member of interprofessional teams.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B330', 'Transcultural Health', 'UG', 3, '(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor) This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence.  Different populations are examined for the development of a personal understanding of the traditions and customs of their societies,  providing a unique perspective on the implications for patient care. (Lecture 3 hours) (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B341', 'Performance of Caring', 'UG', 3, '{THEA B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic,  realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B350', 'Nursing Research', 'UG', 3, '(Prerequisite: STAT B201 and NURS B202 or RN Licensure or consent of Instructor).  Nursing research introduces the basic research process,  including methods commonly used in nursing. Content includes ethical issues,  evaluation of research for evidenced based practice and the nurse researcher role (Lecture 3 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B356', 'Women''s Health Nursing', 'UG', 3, '(Prerequisite: NURS B320 and NURS B326; Co-requisite: NURS B358).  Content includes nursing care of women related to all aspects of reproductive health. Cultural differences are discussed. Coaching strategies and research outcomes for this population are described.  Students will develop safe practice of basic obstetrical and gynecological nursing skills first in a laboratory setting and then apply these skills in a clinical setting (Lecture 3 hours,  Laboratory 1 hour,  Clinical Experience 5 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B357', 'Nursing Concepts in Adult Health', 'UG', 3, '(Prerequisite: Junior Standing) This class will help bridge an identified learning gap between NURS B326 and NURS B425.  The class will reinforce knowledge and application in Adult Health Nursing using a concept-based approach. The content will focus on critical thinking and clinical judgement utilizing the nursing process.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B358', 'Children''s Health Nursing', 'UG', 3, '(Prerequisite: NURS B320 and NURS B326; Co-requisite: NURS B356). Focus is on the nursing care of children and their families. Normal growth and development,  pediatric assessment and common health issues including childhood communicable diseases and genetic abnormalities are presented. Students will develop safe practice of applying basic nursing skills first in a laboratory setting and then in pediatric inpatient and outpatient settings (Lecture 3 hours,  Laboratory 1 hour,  Clinical Experience 5 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B360', 'Gerontological and Rehabilitation Nursing', 'UG', 3, '(Prerequisite: RN licensure,  or NURS B312 and NURS B326,  or permission of the instructor)  Care and special needs of the older adult in various care settings. Gerontological nursing,  presentation of disease,  rehabilitation,  health promotion,  reimbursement and a comprehensive nursing gerontological assessment are covered. (Lecture 3 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B360C', 'Clinical Care of Childbearing Families', 'UG', 3, '(Prerequisite: NURS B320 & B326. Corequisite: NURS B356 & B358) In conjunction with NURS B358,  this course blends practice/simulation laboratory experiences with clinical experiences in care settings where mothers,  infants,  children and family units receive care.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B395', 'Global Healthcare Study Abroad', 'UG', 3, 'Provides students the opportunity to engage in global health fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B399', 'Independent Study in Nursing', 'UG', NULL, 'This course is an advanced study of a particular theme or topic in the nursing through readings,  research,  and analysis. It is designed for students who have completed basic courses and who want to study specific topics that are not offered in the curriculum or extend learning of a topic from a course already completed (i.e.,  develop a poster or manuscript based on a scholarly paper).  A contract of study is developed through readings,  projects,  papers,  and/or seminars approved by instructor.  Up to 3 credits may be contracted and repeated for a total of 6 credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B401', 'Health Care Delivery Systems', 'UG', 3, 'Systems theory; health care delivery systems conceptualizes transitions from one [Level] of care to another with emphasis on ethical and legal issues; technology; historical,  political and economic aspects to meet the health care needs of the population. (Lecture 3 hours)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B410', 'Professional Nursing Leadership and Management', 'UG', 4, '(Pre-requisites: Acceptance to RN-to-BSN program or NURS B326 and NURS B401 or permission of the instructor)   This course provides an introduction to evidence-based nursing leadership and management practice. The course includes theoretical underpinnings of nursing leadership and management,  to prepare the student for the organizational and managerial skills needed for day to day management of staff nurses delivering health care to multiple patients as well as future positions of leadership.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B412', 'Mental Health Nursing', 'UG', 3, '(Prerequisite: NURS B326,  NURS B320,  NURS B350,  and NURS B401). Nursing care of individuals with mental health issues ranging from major psychiatric disorders to short situational stressors is taught with an emphasis on positive mental health. Students will develop safe practice of basic nursing skills first in a laboratory setting and then in community-based and in-patient mental health settings. (Lecture 2 hours,  Laboratory 1 hour,  Clinical Experience 5 hours).');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B415', 'Gerontological and Rehabilitation Nursing', 'UG', 3, '(Prerequisite: NURS B301 or NURS B326 and NURSB 312; Pre or Co-requisite: NURS B350)  Care and special needs of the older adult in various care settings. Gerontological nursing,  presentation of disease,  rehabilitation,  health promotion,  reimbursement and a comprehensive nursing gerontological assessment are covered. (Lecture 3 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B416', 'Inactive Fall 2015 - Community Health Nursing', 'UG', 6, '(Prerequisite: NURS B356 and NURS B358 for pre-licensure students and NURS B350 for all nursing students; Co-requisite or Prerequisite: NURS B401 for all nursing students). Evidence-based nursing with individuals across the lifespan,  families and other diverse population groups. [Level]s of prevention are explored in relationship with epidemiological effects of environment and lifestyle on client health. Laboratory and clinical experience includes identification and application of community resources using a case management approach to provide care in community health centers,  acute care centers,  shelters,  home health and hospice agencies (Lecture 3 hours,  Laboratory 1 hour,  Clinical Experience 8 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B418', 'Community Health Nursing', 'UG', NULL, '(Prerequisites:  NURS B356,  NURS B358,  and NURS 360 for pre-licensure students; NURS B350 for all nursing students; Co-requisite or Prerequisite:  NURS B401 for all nursing students) Evidence-based nursing with individuals across the lifespan,  families,  and across population groups.  [Level]s of prevention are explored in relationship with epidemiological effects of environment and lifestyle on client health. Laboratory and clinical experience include identification and application of community resources using a case management approach to provide care in community health centers,  acute care centers,  shelters,  home health,   hospice agencies,  and other community organizations. (Lecture 3 hours,  Laboratory 1 hour,  Clinical experience 5 hours per week.)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B420', 'Trends and Issues in Nursing', 'UG', 3, '(Prerequisite: NURS B356 and NURS B358 for pre-licensure students) Historical and present trends in nursing practice are taught in this course with a perspective on nursing education,  genetic research,  evidenced-based practice and complementary therapies (Lecture 3 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B422C', 'Clinical Care in Public and Community Health Settings', 'UG', 3, '(Prerequisite: NURS B320,  B326,  B350 and B401. Corequisite: NURS B412 and B418) In conjunction with NURS B412 and NURS B418,  this clinical course focuses on experiential learning in community-based or public health settings. These settings serve primary and prevention care needs of school age,  mental health,  addictions,  or other populations. A change management project that involves priority setting,  delegation,  policy making,  budgeting,  and/or measurement of community impact is introduced. Clinical experience may also include providing community-based education,  care coordination,  and managing resource capacity.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B424', 'Professional Nursing Leadership and Management', 'UG', 3, '(Pre-requisites: NURS B416 and NURS B412 or acceptance RN-to-BSN program; Co-requisites: NURS B426 and NURS B435 and NURS B424P or acceptance RN-to-BSN program) This course provides an introduction to evidence-based nursing leadership and management practice.  The course includes theoretical underpinnings of nursing leadership and management followed by pragmatic,  "real life" application of theory to practice.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B424P', 'Professional Nursing Leadership and Management Practicum', 'UG', 3, '(Prerequisite: Pre-licensure Program,  NURS B416 and NURS B420; Co-requisite: NURS B424 and NURS B435 for pre-licensure students) Principles of management and theories of leadership are implemented in an inpatient facility and/or community setting. Student projects will involve the application of a leadership or management strategy for problem identification and resolution in the clinical area (Laboratory 1 hour, Clinical Experience 8 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B425', 'Adult Health Nursing II', 'UG', 9, 'Through implementation of the nursing process,  students focus on nursing interventions,   as well as applying leadership and management principles,  to coordinate the complex care needs of the adult medical/surgical patient at the bedside and during transitions of care.  Students build on clinical practice from previous courses and apply safe practice of advanced nursing skills in preparation for professional practice.  (Class 3 hours,  Laboratory 3 hours,  Clinical practice 15 hours) (For the Pre-licensure Program: Prerequisite Courses NURS B410,   NURS B412,  NURS B418;  Co-requisite: NURS B435)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B137', 'Yoga II', 'UG', 1, 'This course is a continuation of the Yoga I,  focusing on the understanding and practice of intermediate to advanced yoga asanas (postures),  pranayama (breathing) and meditation technique,  including an introduction to the chakras.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B142', 'Lifeguard Training', 'UG', 1, 'Students will develop proficiency in water safety skills. Successful completion of all course requirement leads to certification in American Red Cross Lifeguard Training,  CPR,  First Aid,  and AED.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B425C', 'Clinical Care of High Acuity Adults & Elders', 'UG', 3, '(Prerequisite: NURS B326,  B326C,  B412,  B418 & B422C. Corequisite: NURS B425) Students will have exposure to adults and elders with high acuity needs. Clinical experiences will focus on the application of knowledge and skills related to the care of a high acuity adult or elder. Emphasis will be placed on application of the nursing process to manage care and reduce risks in this population,  utilization of technology to monitor rapidly changing patient needs,  plan and prioritize care,  anticipate patient needs and contribute to interprofessional teams collaborating care for the high acuity adult or elder.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B426', 'Adult Health Nursing II', 'UG', 6, '(For the Pre-licensure Program: Prerequisite Courses NURS B412,  NURS B415 and NURS B416; Co-requisite: NURS B424 and NURS B435).  Through implementation of the nursing process,  students focus on nursing interventions for the care of adult clients experiencing critical,  multi-system alterations in function.  Students will build on clinical practice from previous courses and apply safe practice of advanced nursing skills in an intensive clinical setting (Lecture 3 hours,  Clinical experience 9 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B430C', 'Clinical Synthesis and Seminar', 'UG', 3, '(Prerequisite: NURS B412,  B418 and B422C) In this clinical course,  students will have an opportunity to model program outcomes and strengthen their abilities to manage a client population throughout a shift,  focusing on organizational,  delegation,  and time management skills. Priority setting and the ability to develop focus in delivering care to more than one client are emphasized. In the seminar setting,  synthesis of clinical information linked to individuals,  families,  and communities will be reviewed. Role understanding and clinical functioning will be evaluated to meet entry-[Level] practice expectations. Knowledge of patient education,  discharge planning,  team functions,  and nursing skills will be demonstrated.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B435', 'Professional Nursing Seminar', 'UG', 8, '(Prerequisite: NURS B415 and NURS B416; Co-requisite: NURS B424 and NURS B426 for pre-licensure students). This course prepares the pre-licensure student for transition to the role of professional nurse. An overview of career choices,  readiness for NCLEX exam and continuing education and career advancement in the workplace is presented (Lecture 1 hour).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B441', 'Capstone: Professional Nursing Project', 'UG', 3, '(Prerequisite: All other RN-BSN nursing courses). The student will identify a project that synthesizes professional nursing curriculum theory and principal threads of Assessment,  Critical thinking,  Emotional Intelligence,  Care Coordination and Cultural competence. The student will investigate a professional nursing issue,  plan a project individualized to the students interests and develop a learning contract for a project is identified,  planned and implemented that focuses on a professional nursing issue. The student will use curriculum threads of Assessment,  Critical thinking,  Emotional Intelligence,  Care Coordination and Cultural competence to complete this clinical experience. (Seminar 2 hours,  Clinical Experience 9 hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B450', 'Ethical Decision-Making,  Legal Issues and Health Policy in Professional Nursing', 'UG', 3, '(Prerequisite: NURS B202 or B301) This course examines legal and ethical issues in healthcare and how they influence health policy. Students study legal principles governing profesional nursing practice and explore frameworks to support ethical decision-making across the continuum of care. The nurse''s role in healthcare policy  development,  implementation and analysis are explored,  particularly as it relates to legal and ethical issues affecting practice. Students explore current legal/ethical issues and existing health policies,  with an emphasis on how these issues impact access to,  and delivery of healthcare services to vulnerable populations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('NURS', 'B499', 'Special Topics in Professional Nursing Practice', 'UG', 3, '(Prerequisite: NURS B326 or B301 or consent of instructor) This course examines advanced concepts,  emerging trends and issues,  and evidenced-based practice changes in professional nursing practice. Variable hours between 1-3 credits,  depending upon special topic. Topics may include complementary and alternative health practices,  end-of-life and palliative care,  working with special populations,  and nursing theories.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B101', 'RAD Self-Defense for Women', 'UG', 1, 'An introduction to the principles,  techniques,  and active practice of self-defense for women.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B104', 'Personal Fitness and Weight Control', 'UG', 1, 'Assessment of major fitness components and development of a personalized exercise program based on fundamental principles of exercise prescription.  Weight management and dietary guidelines will be addressed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B105', 'Weight Training', 'UG', 1, 'An introduction to progressive resistance training and participation in a personalized strength training program with emphasis on proper technique and safety principles.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B106', 'Weight Training II', 'UG', 1, 'This course expands on skills learned in PEDU B105 (Weight Training I) and is designed to further students knowledge of weight training principles and techniques. Students create a personalized weight-training program designed to build muscular strength,  endurance and power. Instruction includes musculoskeletal anatomy and weight training strategies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B107', 'Aerobic Fitness', 'UG', 1, 'Participate in aerobic fitness activities designed to improve cardiovascular endurance.  Includes aerobic fitness assessment along with individualized and group aerobic fitness training.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B112', 'Basketball', 'UG', 1, 'Fundamental skills of game performance. Strategy,  rules,  and basic offenses and defenses.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B113', 'Bowling', 'UG', 1, 'An Introduction to the fundamentals of bowling,  with an emphasis on basic techniques in all facets of the game,  as well as an understanding of terminology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B114', 'Golf', 'UG', 1, 'Basic strokes,  rules and strategy of golf.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B117', 'Karate', 'UG', 1, 'Karate');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B119', 'Soccer', 'UG', 1, 'Fundamental skills for game performance; history,  rules,  and game strategy.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B121', 'Beginning Tennis', 'UG', 1, 'Introduction to the game of tennis.  All aspects of the game for new players including technical,  tactical,  physical and mental skills will be developed.  The emphasis will be on helping students serve,  rally and score and to build their knowledge and skill base.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B130', 'Intermediate Golf', 'UG', 1, '(Prereq: PEDU 114 or consent of instructor) Intermediate strokes and strategies; heavier emphasis on the total golf swing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B136', 'Yoga I', 'UG', 1, 'Explore the mind-body connection through participation in yoga poses,  transitional movements,  and progressive relaxation techniques. Build strength,  flexibility,  muscle tone,  and mindfulness while improving one''s sense of well-being.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B147', 'Kayaking', 'UG', 1, '(Prerequisite: successful completion of deep water swim exam) Supervised calm water single kayak paddling.  Emphasis on safety,  equipment selection,  basic paddle and kayak-handling techniques,  fitness considerations,  travel safety,  rescue and survival techniques.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B148', 'Stand Up Paddle Boarding', 'UG', 1, 'A supervised calm water stand up paddling experience.  Emphasis on safety,  equipment selection,  paddle and board-handling techniques,  fitness,  travel safety,  rescue and survival techniques.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B153', 'Heartsaver CPR/First Aid/AED', 'UG', 1, 'The study and practice of early emergency care procedures,  including first aid; choking relief in adults,  children,  and infants; and what to do for sudden cardiac arrest in adults,  children,  and infants.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B171', 'Line Dancing', 'UG', 1, 'An enjoyable non-partner dance activity that exposes students to a variety of popular line dances,  musical genres,  line dance etiquette,  and developmental history. Dance experience not necessary.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B181', 'Equestrian', 'UG', 1, 'English hunter-style riding for intermediate students.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B189', 'Indoor Cycling', 'UG', 1, 'An introduction to the basic findamentals of indoor cycling.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PEDU', 'B202', 'Foundations of Coaching', 'UG', 2, 'Explore coaching philosophies,  coaching techniques,  training fundamentals,  risk management and group management strategies.  Emphasis placed on coaching skills necessary for working with children.  Includes practical experience and evaluation of coaching situations.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B102', 'Introduction to Philosophy', 'UG', 3, 'PHIL B102 - INTRODUCTION TO PHILOSOPHY (3). An introduction to the main problems of philosophy and its methods of inquiry,  analysis and criticism. Works of important philosophers will be read.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B110', 'Introduction to Formal Logic: Deduction & Inference', 'UG', 3, 'This course is an introduction to deductive reasoning. The focus will be on the use of formal methods to construct and criticize actual arguments. Particular emphasis will be placed upon Aristotelian logic,  sentential logic,  and predicate logic. Student will develop skills in the development and analysis of syllogisms,  Venn Diagrams,  truth tables,  and formal proofs.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B111', 'Introduction to Informal Logic: Reasoning & Analysis', 'UG', 3, 'This course is an introduction to inductive reasoning. The focus will be on argumentation and argument analysis. Students will develop skills for: identifying argumentative language; determining the type of argument present; constructing argument maps; evaluating arguments in term of inductive standards; and identifying various informal fallacies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B201', 'History of Ancient Philosophy', 'UG', 3, 'An introduction to the development of philosophy in the ancient world through study of the works of representative philosophers. BPHI 202 may be taken prior to this course.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B202', NULL, 'UG', 3, 'An introduction to the development of philosophic thought since the Renaissance through the study of the works of important philosophers. The chief emphasis is on the 17th and 18th centuries.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B211', 'Contemporary Moral Issues', 'UG', 3, 'Moral issues confronting men and women in contemporary society. Topics will vary but may include discussion of problems related to abortion,  drugs,  euthanasia,  war,  social engineering and punishment of criminals.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B212', 'Conflicting Images of Man', 'UG', 3, 'Conflicting images of man in contemporary philosophy,  literature,  psychology and religion and an evaluation of these images as norms for human conduct and social policy. Particular attention will be given to existentialist,  Marxist,  behaviorist and mystical images of man.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B301', 'Nineteenth and 20th Century Philosophy', 'UG', 3, 'An introduction to Continental and British philosophy since Kant through study of the works of representative philosophers. Particular emphasis is placed on the development of Idealism,  Marxism,  Existentialism and Phenomenology and analytic philosophy.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B302', 'American Philosophy', 'UG', NULL, 'The principal movements of philosophical thought from Colonial times to the present,  with special emphasis on the 19th and 20th centuries.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B303', 'Critical Social Theories', 'UG', NULL, 'This course is an introduction to the critical social theories that have developed since the late 19th century. Critical social thought in philosophy focuses on various socio-historical conditions in contemporary society,  as well as on the sociocultural methods that are used to study them. Possible frameworks may include Marxism,  Neo-Marxism,  feminist philosophies,  queer theory,  critical race theory,  and post-analytic philosophy. Social and cultural topics may include race,  gender,  global economic dynamics,  Internet culture,  and social media.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B304', 'History of Analytic Philosophy', 'UG', 3, 'This course is an introduction to analytic philosophy in the British and American philosophical traditions,  emphasizing epistemology and the philosophy of language. Particular attention will be given to developments arising out of logical positivism and ordinary language philosophy.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B311', 'Ethics', 'UG', NULL, 'A study of the moral principles of conduct and the basic concepts underlying these principles,  such as good,  evil,  right,  wrong,  justice,  value,  duty and obligation. The ethical works of influential philosophers are analyzed in terms of these concepts.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B312', 'Bioethics', 'UG', 3, 'The concepts of Person and Justice as they relate to biomedical sciences and technologies.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B313', 'Philosophy of Art', 'UG', 3, 'Philosophical problems relating to the arts,  with emphasis on questions pertaining to aesthetic experience.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B315', 'Philosophy of Technology', 'UG', 3, 'This course will focus on the various philosophical questions and issues that arise from the technological opportunities and challenges of the 21st century. Philosophical topics surrounding technology will include those related to ethics,  the philosophy of language,  feminism,  critical theory,  and pragmatism. Possible topics regarding technology may include information technologies,  robotics,  AI,  genetic engineering,  cyborgs,  climate change/geoengineering/the Anthropocene,  and social media technologies. Finally,  we investigate how technological developments stimulate philosophical thinking.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B320', 'Existentialism', 'UG', NULL, 'An introduction to existentialist themes in contemporary philosophy,  literature,  psychology and religion. The writings of existentialists such as Kierkegaard,  Nietzsche,  Camus,  Sartre,  Buber,  May and Binswanger will be read and discussed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B341', 'Environmental Ethics', 'UG', NULL, 'Examination of principles and arguments surrounding moral issues involving the environment.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B363', 'Philosophy of Film', 'UG', 3, '{LBST B363}  (Prerequisite: ENGL B101/B105 and ENGL B102/B106)  Interdisciplinary course with emphasis on topical study of film theory,  the aesthetics of film as an art form,  the social impact and relevance of film.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B397', 'Readings in Philosophy', 'UG', NULL, 'A systematic study of a primary source in philosophy having relevance to other disciplines.  Can be conducted as a small course or as a tutorial.  May be taken twice for credit.  (Prereq: junior standing and completion of General Education English and Humanities requirements.)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B398', 'Topics in Philosophy', 'UG', 3, '(Prerequisite:  Specific prerequisites may vary; consult the instructor.) Intensive study of selected themes,  topics,  currents of thoughts or interdisciplinary concerns. May be repeated for credit under a different topic.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHIL', 'B399', 'Independent Study in Philosophy', 'UG', 3, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for Academic Affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B101', 'The Physics of How Things Work I', 'UG', 3, 'A practical introduction to physics and science in everyday life from concrete examples to basic physical principles.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B101L', 'The Physics of How Things Work I Laboratory', 'UG', 1, '(Prereq or Coreq: PHYS B101) Experiments,  exercises and demonstrations to accompany PHYS B101.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B102', 'The Physics of How Things Work', 'UG', 3, '(Prereq: PHYS B101) A continuation of PHYS B101 with emphasis on electricity,  magnetism,  optics and atomic physics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B102L', 'The Physics of How Things Work II Laboratory', 'UG', 1, '(Prereq or Coreq: PHYS B102) Experiments,  exercises and demonstrations to accompany PHYS B102.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B201', 'General Physics I', 'UG', 3, '(Prereq: MATH B115,  or MATH B122,  or equivalent) First part of an introductory course sequence. Topics include mechanics,  wave motion,  sound and heat. No previous background in physics is assumed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B201L', 'General Physics I Laboratory', 'UG', 1, '(Prereq or Coreq: PHYS B201 or B211)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B202', 'General Physics II', 'UG', 3, '(Prereq: a grade of C or better in BPHY 201) Continuation of BPHY 201; includes electromagnetism,  relativity,  quantum physics,  atomic and nuclear physics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B202L', 'General Physics II Laboratory', 'UG', 1, '(Prereq or Coreq: PHYS B202).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B211', 'Essentials of Physics', 'UG', 3, '(Prerequisite: a grade of C or better in MATH B141; Co-requisite: PHYS B211L) Classical mechanics and wave motion. Calculus-[Level] course for students of science and engineering.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B211L', 'Essentials of Physics I Laboratory', 'UG', 1, '(Prereq or Coreq: PHYS B211)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B212', 'Essentials of Physics II', 'UG', 3, '(Prereq: a grade of C or better in PHYS B211 and MATH B142; Coreq: PHYS B212L) Classical electromagnetism and optics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B212L', 'Essentials of Physics II Laboratory', 'UG', 1, '(Prereq or Coreq: PHYS B212)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PHYS', 'B398', 'Advanced Topics and Physics', 'UG', NULL, 'Study of a topic not otherwise available to student.  May involve reading assignments,  tutorial,  lectures,  papers,  presentations,  or field or laboratory study,  determined in consultation with instructor.  Repeatable to a maximum of 8 credit hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B105', 'Introduction to Politics', 'UG', 3, 'Concepts and problems involved in human relationship with governments,  the nation-state and political change.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B111', 'Contoversies in American Politics', 'UG', 3, 'An introduction to the analysis of key issues in contemporary American politics focusing on the arguments,  the groups involved and the political factors that influence the outcome of the debate.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B201', 'American National Government', 'UG', 3, 'The formation and development of the national government,  its organization and powers.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B315', 'Internatioanl Relations', 'UG', 3, 'International political behavior and institutions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B370', 'Introduction to Public Administration', 'UG', NULL, 'A study of the basic principles and theory of administrative structure,  responsibility and control in relation to policy making in the modern state.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B399A', 'Independent Study in Political Science', 'UG', NULL, 'Contract approval by instructor,  advisor,  Department Chair and Executive Vice Chancellor for Academic Affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B399', 'Independent Study in International Studies', 'UG', NULL, 'Contract approval by instructor,  advisor,  Department Chair and Executive Vice Chancellor for Academic Affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('POLI', 'B400', 'Selected Topics in Political Theory', 'UG', NULL, 'Intensive analysis of a particular topic or topics. To be identified by suffix and title each semester.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B101', 'Introduction to Psychology', 'UG', 3, 'An introduction to and survey of the basic concepts and findings within the field of psychology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B200', 'Research Methods in Psychology', 'UG', 3, 'Basic principles and methodology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B201', 'Statistics Laboratory in Psychology', 'UG', 3, 'Psychological experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B202', 'Psychological Statistics', 'UG', 3, 'Introduction to statistical methods essential for psychological research.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B203', 'Laboratory in Psychology', 'UG', 3, '(Prereq: PSYC B200 and STAT B201 and PSYC B201 or PSYC B200 and PSYC B227) Laboratory in psychology in which research methods and statistical methods are integrated. One lecture and one laboratory session per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B209', 'Human Growth and Development', 'UG', NULL, 'An introduction to and survey of physical,  mental,  social,  and emotional developmental patterns evidenced from the prenatal period through senescence and death.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B210', 'Psychology of Adjustment', 'UG', 3, 'Introduction to theories and processes underlying and facilitating human adjustment in the community,  family and workplace.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B212', 'Applied Psychology', 'UG', 3, 'Uses of psychological knowledge and techniques in practical contexts; clinical,  school,  industrial,  consumer and environmental psychology.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B214', 'Human Sexual Behavior', 'UG', 3, 'Psychological,  physiological and sociological factors of human sexual behavior and attitudes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B216', 'Psychology of Marriage', 'UG', 3, 'The psychological,  physiological and social characteristics of marriage.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B218', 'Psychology of Women', 'UG', 3, 'Women''s experiences: childhood and adolescence,  work,  family,  cultural images,  adjustment and social change.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B220', 'Psychology of Religion', 'UG', 3, 'The development of the religious consciousness and its various expressions,  the psychological dynamics of growth and conversion,  response to crisis and the relation of spiritual practice to health and wholeness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B224', 'Industrial/Organizational Psychology', 'UG', 3, 'Psychological techniques applied to various industrial and organizational problem areas,  such as management and supervision,  morale,  efficiency,  training,  personnel selection and placement and relations among personnel.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B229', 'Sport Psychology', 'UG', 3, 'The role of sports in socialization,  personality development and competence,  including: spectator-performer interactions,  motivation,  competition effects; and the application of psychological techniques to performance enhancement.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B302', 'Learning and Memory', 'UG', 3, '(Prereq: PSYC B101) Research and applications concerning the acquisition of new behavior and knowledge,  including accounts based on classical and instrumental conditioning and on information-processing models.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B303', 'Principles of Gerontology', 'UG', NULL, '(HMSV B303 & SOCY B303) An exploration of the interdisciplinary field of gerontology,  including the fundamental concepts,  theories,  and issues involved in the study of aging from diverse perspectives.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B311', 'Abnormal Psychology', 'UG', 3, '(Prereq: PSYC B101) Covers the classification,  diagnosis,  etiological theories and treatments of the major mental and emotional disorders.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B312', 'Abnormal Behavior in Children', 'UG', 3, '(Prereq: PSYC B311 or consent of nstructor) Theories,  description and assessment of child behavior problems and disorders; methods of intervention.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B321', 'Life Span Developmental Psychology', 'UG', 3, '(Prereq: PSYC B101) Psychological development from conception to late adulthood. Topics include physical,  cognitive and social processes associated with development at each stage of the life cycle.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B322', 'Psychology of Child Development', 'UG', 3, '(Prereq: PSYC B101) Examination of development from conception through older childhood. Specific cognitive and social processes will be given in-depth study.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B324', 'Psycholgoy of Adolescence', 'UG', NULL, '(Prereq: PSYC B101) Theories and research examining social,  emotional and intellectual development in adolescence. Explores influence of family,  peer,  school and cultural contexts.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B326', 'Psychology of Early and Middle Adulthood', 'UG', NULL, '(Prereq: PSYC B101) Developmental changes in abilities,  personality and behavior which occur between adolescence and old age.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B328', 'Psychology of Aging', 'UG', 3, '(Prereq: PSYC B101) Psychological,  social and biological phenomena associated with maturity and aging.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B331', 'Social Psychology', 'UG', 3, '(Prereq: PSYC B101) Introduction to theory and research in social psychology from a psychological viewpoint. Topics include social perception,  social cognition,  attitudes,  interpersonal relationships,  aggression,  prosocial behavior and group processes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B341', 'Personality Theory', 'UG', 3, '(Prereq: PSYC B101) Covers the major theories and research on personality and the dynamics of human motivation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B361', 'Biological Psychology', 'UG', 3, '(Prereq: PSYC B101) The neurochemical and neuroanatomical bases of behavior ranging from the reflex to schizophrenia.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B380', 'Cultural Psychology', 'UG', 3, '(Prerequisite: PSYC B101) A global cultural perspective on human behavior exploring how culture influences our lives and the lives of others across the world. Topics may include cultural influences on development,  mental health,  cognition,  personality and social behavior.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B399', 'Independent Study in Psychology', 'UG', NULL, '(Prereq: PSYC B101 and consent of instructor) Closely supervised project or research experience in psychology. Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for Academic Affairs is required. May be repeated for up to six credit hours. Not for psychology major credit.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B401', 'Cognitive Psychology', 'UG', 3, '(Prereq: PSYC B302) Research and theories on sensory memory,  attention,  short-term and working memory,  human learning and forgetting,  imagery,  long-term memory,  speech perception,  reading,  language,  thinking and problem solving and decision making.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B404', 'Psychology Consumer Behavior', 'UG', NULL, '(Prerequisite: PSYC B101) Psychological Principles and concepts applied to advertising and selling,  promotion,  consumer attitudes,  psychological measurement and prediction,  and influence in consumer behavior.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B406', 'History and Systems of Psychology', 'UG', 3, '(Prereq: 9 hours in psychology at 300 [Level] or above) Systematic approaches to psychology and the history of psychology');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B409', 'Positive Psychology', 'UG', 3, 'Research and theories on psychological well-being and happiness.  Topics include subjective well-being,  positive affect and emotions,  flow,  resilience,  correlates of happiness,  self-regulation,  virtues and character,  interpersonal relationships,  and mindfulness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B411', 'Introduction to Clinical Psychology', 'UG', 3, '(Prereq: PSYC B311 and B341 or consent of instructor) An introduction to the science and practice of clinical psychology. Application of psychological principles to the assessment and treatment of mental disorders and behavioral problems in human beings.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B415', 'Community Psychology', 'UG', 3, 'Application of knowledge from other areas of psychology to the study of the role of the individual in the community.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B418', 'Psychology of Drug Use and Effects', 'UG', 3, '(Prereq: consent of instructor) Research and theoretical considerations of substance abuse. Pharmacological,  sociological,  psychological,  medical,  economic,  forensic and other relevant research and treatment disciplines.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B425', 'Psychology and the Legal System', 'UG', 3, 'The role of psychologists in the legal system,  psychological issues within the legal system,  interpretations of victims and criminality,  and treatment of offenders.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B441', 'Psychological Tests and Measurement', 'UG', 3, '(Prereq: STAT B201 and PSYC B201 or consent of instructor) Overview of the nature,  design and application of psychological tests. Emphasis on test construction,  the psychometric properties of psychological tests,  intelligence and aptitude testing,  objective and projective tests of personality and general issues in the application of tests.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B451', 'Sensation and Perception', 'UG', 3, '(Prereq: PSYC B101) Processing of information from the environment. Physiological,  physical,  psychological and contextual determinants of perception.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B465', 'Health Psychology', 'UG', 3, 'An introduction to the interdisciplinary subfield of psychology dedicated to promoting and maintaining health and preventing and treating illness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B490', 'Selected Topics in Psychology', 'UG', 3, 'Course content varies and will be announced in the schedule of classes by suffix and title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B494', 'Advanced Research Methods in Psychology', 'UG', 3, '(Prerequisite: PSYC B200 and [PSYC B202 or STAT B201]) This course provides an integration of research methods and statistical methods. Students will design and complete a psychology research project.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B495', 'Internship in Psychology', 'UG', 3, '(Prereq: Psychology Majors only,  15 hours of psychology,  consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world.  Minimum requirement of 150 service hours.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B496', 'Internship in Psychology II', 'UG', NULL, '(Prereq: Psychology Majors only,  BPSY 495,  and consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world.  Required service hours: 150 - 300 (depending on credit hours).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B498', 'Advanced Independent Study', 'UG', NULL, '(Prereq: 9 hours of psychology and consent of instructor) Closely supervised project or research experience in psychology. Approved contract required. May be repeated for up to six credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PSYC', 'B499', 'Individual Research', 'UG', 3, '(Prereq: 15 hours of psychology and consent of instructor) Planning and execution of supervised research in psychology. Approved contract required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B101', 'Basic Health', 'UG', 3, 'This course is a basic health course in which students will learn about strategies to improve health. Nutrition,  fitness,  drugs,  and sexuality are some of the topics discussed. Career opportunities within the heath field will be explored.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B242', 'Nutrition', 'UG', 3, '{HRTM B242} Introductory course on human nutrition. Includes principles of normal nutrition,  basics of life cycle nutrition,  relationship of nutrients to health and disease,  and discussion of current issues.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B300', 'Transcultural Health', 'UG', NULL, '(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies,  providing a uniquie perspective on the implications for patiend care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding requirement)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B303', 'Health & Wellness Innovation: Creative Inquiry', 'UG', NULL, '{NURS B303} (Prerequisite: PUBH B310) The purpose of this course is to introduce and encourage health professional-driven innovation. This course equips students with an empathetic mindset to see healthcare and public health issues from the perspective of the person who is experiencing the challenge. Students will develop new and creative ways to improve health and well-being.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B305', 'Spirituality,  Health,  and Health Professions', 'UG', NULL, 'Exploration of spirituality,  its effect on health,  and health professionals roles in the spritual care of clients.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B310', 'Introduction to Public Health', 'UG', 3, 'A broad-based overview of those processes that enable people to assume responsibility for health and wellness and the role of the health promotion professional.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B315', 'Health Promotion Across the Lifespan', 'UG', 3, '(Prerequisite: PSYC B209 or PSYC B321) The study of age as a determinant of health and disease outcomes across the lifespan with strategies to promote wellness.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B320', 'Chronic Disease and Risk Reduction', 'UG', 3, '(Prerequisite: BIOL B243 and BIOL B244,  or equivalent coursework) The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B321', 'Fundamentals of Occupational Health & Safety', 'UG', NULL, '(Prerequisite:PUBH B310)Anintroductorycoursecoveringmajorissuesinoccupationalhealthandsafety, withanemphasisontheidentification, evaluationandcontrolofphysical, chemical, biologicalandbehavioralfactorsoftenpresentintheworkplaceandposeariskforillness, injuryanddeath.Aspeopletypicallyworkatleast40hoursperweekformostoftheiradultlives, theworkplacehasthepotentialtosignificantlyimpacthumanhealthandwellbeing.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B322', 'Life-Cycle Nutrition', 'UG', 3, '(Prerequisite: HRTM/PUBH B242) This course examines the essentials of human nutrition and the modification of nutritional needs at different life stages,  including pregnancy,  lactation,  infancy,  childhood,  adolescence,  adulthood,  and older adulthood.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B323', 'Introduction to Exercise and Sports Science', 'UG', 3, '(Prerequisite: BIOL B243 and BIOL B244) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B325', 'Sports Nutrition', 'UG', 3, '{HRTM B320} (Prerequisite: PUBH/HRTM B242) The study of the association between nutrition and exercise performance. Metabolism of carbohydrates,  fats,  proteins,  vitamins,  minerals and water and its effect on athletic training is emphasized. Nutrition assessment of athletes,  how to measure body composition,  and the use of and controversy over ergogenic aids are explored.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B328', 'Nutrition and Chronic Disease', 'UG', 3, '(Prerequisite: HRTM/PUBH B242) Explore the relationship of food,  diet and lifestyle choices to the prevention and management of various chronic diseases. Main topic areas include type 2 diabetes,  cardiovascular disease,  digestive health,  obesity and cancer.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B330', 'Principles of Epidemiology', 'UG', 3, 'Prerequisite: PUBH B310) The study of the patterns,  causes,  and effects of health and disease.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B340', 'Introduction to Environmental Health', 'UG', 3, '(Prerequisite: PUBH B310) The study of environmental factors,  be they physical,  chemical,  biological or behavioral,  that have the potential to adversely impact human and/or ecological health.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B350', 'Health Communication', 'UG', 3, 'Examines the strategies of health communication in interpersonal,  group,  organizational,  societal-cultural,  political-economic,  and historical contexts. (Cross-List with COMM B350)');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B360', 'Health Behavior and Education', 'UG', 3, 'Prerequisite: PUBH B310) The study of behavioral and social factors that influence health and disease. Models of health behavior theory will be presented. Methods for preparation of health education curricula will be discussed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B370', 'Wellness in Health Promotion', 'UG', NULL, '(Prerequisite: BIOL B243 and BIOL B244,  or equivalent coursework; and HRTM B242) The study of the roles of nutrition,  exercise,  hygiene and rest in the preventaion of disease and the achievement of optimal health.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B380', 'Research Methods in Public Health', 'UG', 3, '(Prerequisite: STAT B201 and PUBH B310) A course designed to impart knowledge and skills regarding the design,  implementation,  analysis and interpretation of research in the field of health promotion.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B390', 'Field Experience in Public Health', 'UG', 3, '(Prerequisite: {UBH B310 and Junior Status) A period of introductory work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B395', 'Global Healthcare Study Abroad', 'UG', 3, '(Prerequisite: Permission of the instructor) Provides students with the opportunity to engage in global healthcare fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B399', 'Independent Study in Public Health', 'UG', 1, '(Prerequisite: PUBH B310 or consent of instructor) This course examines concepts,  emerging trends,  issues,  and evidence-based practice changes in public health practice. Variable hours between 1 to 4 credits,  depending on topic which may include complementary and alternative health practices,  working with special populations,  emerging public health needs,  etc. Students may re-take one additional time for a maximum of 8 credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B401', 'Health Care Delivery Systems', 'UG', 3, '(Prerequisite: PUBH B310 or NURS B326 or RN Licensure or ceonsent of instructor) Systems theory,  health care delivery systems conceptualize transitions from one [Level] of care to another,  with emphasis on ethical and legal issues; technology,  historical,  political,  economic aspects to meet the health care needs of the population.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B410', 'Examining Health Inequalities', 'UG', 3, '(Prerequisite: PUBH B310) This course is designed to examine health disparities and associated social determinants of health in the U.S. Also included is an exploration of multi-[Level] intervention strategies for reducing health disparities.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B420', 'Leadership and Management in Public Health', 'UG', 3, '(Prerequisite: PUBH B310) This course is designated to enhance leadership and management skills needed to design,  implement and evaluate health promotion programs.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B423', 'Business & Practice of Personal Training', 'UG', NULL, '(Prerequisite: Grade of B or better in PUBH B323) The continuation of PUBH B323,  this practical course surveys the skills and knowledge required for success in the field of personal training. Following National Academy of Sports Medicine guidelines,  the kinesiology and physiology of human performance and the effective development of a personal training enterprise are investigated.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B431', 'Nutrition and Metabolism', 'UG', NULL, '(Prerequisite: PUBH/HRTM B242,  BIOL B110,  and a 3-4 credit hour CHEM course) Examines the physiology and metabolism of micro and macro nutrients,  and how principles of nutrition impact metabolic regulation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B432', 'Public Health Nutrition', 'UG', 3, '(Prerequisite: PUBH/HRTM B242) Impact of nutrition policy on the publics health is reviewed.  This course examines the complex,  multifaceted range of programs and services dedicated to bettering the populations health through nutrition. Considers policymaking,  assessment and intervention methods,  special populations and food security.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B450', 'Public Health Program Development', 'UG', 3, '(Prerequisite: PUBH B310) A study of methods used to develop effective health promotion and education programs which help enable individuals prevent,  delay and treat disease.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B460', 'Public Health Program Evaluation', 'UG', 3, '(Prerequisite: PUBH B450) A study of evaluation methods used to assess the potential impacts of health promotion programs.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B461', 'Writing in the Health Professions', 'UG', 3, '(Prerequisite: PUBH B310) Preparation for and practice in types of writing important to those working within the health care and health promotion industry,  from brief letters to formal articles and reports.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B480', 'Internship in Public Health', 'UG', 4, '(Prerequisite: PUBH B450; Corequisite: PUBH B460) A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where health promotion principles are applied.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B490', 'Senior Seminar in Public Health', 'UG', 2, '(Prerequisite: PUBH B310) A capstone course that summarizes the experiences of the health promotion major and prepares students for employment and/or graduate study.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('PUBH', 'B499', 'Special Topics in Public Health', 'UG', 3, '(Prerequisite: PUBH B310 or consent of instructor) This course examines advanced concepts,  emerging trends and issues,  and evidence-based practice changes in public health practice. Variable hours between 1 to 4credits,  depending on special topic. Topics may include complementary and alternative health practices,  working with special populations,  emerging public health needs,  etc. Students may re-take one additional time for a maximum of 8 credits.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('RELG', 'B110', 'Introduction to Religious Studies', 'UG', NULL, 'An introduction to the methods of religious inquiry and to the beliefs and practices of major religious traditions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('RELG', 'B111', 'Biblical History and Literature', 'UG', 3, 'A brief introduction to contemporary study of the Bible,  its historical background,  writing and transmission,  its principal persons,  events and ideas and their significance for the present time.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('RELG', 'B114', 'Religion and Culture', 'UG', 3, 'The impact of religion on modern Western culture and of culture on religion. Selected topics: Holocaust,  Freud,  love,  evil,  puritanism,  fundamentalism.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('RELG', 'B203', 'Comparative Religion', 'UG', 3, 'The religious experience of varied persons and groups,  East and West,  in traditional and contemporary settings.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('RELG', 'B360', 'Anthropology of Magic and Religion', 'UG', NULL, '{=BANT 352}  A comparative examination of such topics as ritual,  cosmology,  revitalization movements,  magic,  witchcraft,  myth and possession.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('RELG', 'B499', 'Special Topics in Religious Studies', 'UG', 3, 'Reading and research on selected topics in Religious Studies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B101', 'Introductory Sociology', 'UG', 3, 'An introduction to sociological facts and principles: an analysis of group-making processes and products.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B220', 'Elementary Statistics for Sociologist', 'UG', 3, 'An introduction to concepts and application of quantitative methods,  including descriptive and inferential statistics. Emphasis on analysis of empirical sociological data.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B300', 'Social Structures', 'UG', 3, '(Prereq: STAT B201) Selected theoretical orientations,  methodological procedures and illustrative substantive data pertaining to social structures.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B301', 'Introduction to Gender Studies', 'UG', 3, 'Theories,  methods and substantive issues in the study of gender and sexuality,  grounded in the social sciences and humanities,  using an interdisciplinary approach.  Prerequisite: Introduction to Sociology or Psychology or permission of instructor.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B303', 'Principles of Gerontology', 'UG', 3, '(HMSV B303 & PSYC B303) An exploration of the interdisciplinary field of gerontology,  including the fundamental concepts,  theories,  and issues involved in the study of aging from diverse perspectives.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B305', 'Sociology of Family', 'UG', 3, 'Sociological perspectives related to various aspects of family behaviors,  roles and values.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B307', 'Sociology of Religion', 'UG', 3, 'Sociological perspectives related to selected aspects of religious behavior. Includes references to non-Western religions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B308', 'Community Organization', 'UG', 3, 'An analysis of formal and informal organization,  the interrelationships among public and private agencies and means through which community action programs are initiated,  coordinated and maintained.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B309', 'Introduction to Social Inequality', 'UG', 3, 'This course applies a sociological framework to understand social stratification and inequality. Students will learn major sociology paradigms or meta-theories of the relationship of society to the individual and will apply them in the empirical analysis of social inequality.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B310', 'Social Demography', 'UG', 3, '(Prereq: SOCY B220 or equivalent course in quantitative methods) Selected theoretical orientations,  methodological procedures and illustrative substantive data pertaining to population.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B311', 'Ecology of Human Social Systems', 'UG', 3, 'Relationships among and changes in populations,  social organization,  technology and the environment.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B313', 'Sociology of Aging', 'UG', 3, 'Analysis of aging as a process of socialization and the status of older people in society,  their roles in the community,  demographic aspects of aging and the impact of aging upon social institutions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B314', 'Applied Sociology', 'UG', 3, '(Prerequisite: SOCY B101 or consent of instructor) Introduces students to the uses of sociological concepts,  skills and tools to actively analyze and engage problems facing a variety of clients and organizations including business,  government,  religion and other community agencies and groups. Emphasizes case studies and hands-on experience to identify,  investigate and actively seek solutions to issues of structure,  process and social change.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B315', 'World Population: Problems and Policies', 'UG', 3, 'World population growth and concomitant socioeconomic problems. Effectiveness of governmental policies concerned with population growth. Topics include over-population.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B320', 'Individual and Society', 'UG', 3, '(Prereq: SOCY B220 or equivalent course in quantitative methods) Selected theoretical orientations,  methodological procedures and illustrative substantive data pertaining to the relations between the individual and society.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B323', 'Sociology of Deviant Behavior', 'UG', 3, 'Theories,  methodology and substantive issues in the study of social deviance.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B325', 'Sociology of Childhood', 'UG', 3, 'A consideration of the child in the family group,  play group,  school group and community.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B326', 'Sociology of Adolescence', 'UG', 3, 'Sociological perspectives and research findings related to adolescence.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B340', 'Introduction to Social Problems', 'UG', 3, 'Normative dissensus and behavioral deviance in society and their consequences for social change and social order. Problems may include: mental disorders,  juvenile delinquency,  crime,  drug abuse,  alcoholism,  suicide,  sexual pathology,  race and ethnic relations,  world population crises and work problems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B341', 'Sociology of Death and Dying', 'UG', 3, 'The social and psychological processes of dying; community reactions to death; social institutions for resolving death problems.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B349', 'Sociology of Food', 'UG', 3, 'Exploration of the sociological issues surrounding food and the impact food makes on our personal and public lives.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B350', 'Sociology of Delinquent Youth Behavior', 'UG', 3, 'Social factors in the development,  identification and treatment of delinquents.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B351', 'Urban Sociology', 'UG', 3, 'Analysis of urban trends,  characteristics and functions of cities with reference to the social psychological factors in urban living. Attention is directed to the emergence of urbanism in the United States,  with particular reference to the Southern region and to institutions,  problems and city planning.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B352', 'Sociology of Literature', 'UG', NULL, '(Prereq: SOCY B101) Social factors in the production and reception of literature. Theories,  methods and substantive issues in a sociological approach to literature.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B353', 'Sociology of Crime', 'UG', 3, 'Social factors in the development,  identification and treatment of criminals.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B354', 'Collective Behavior', 'UG', 3, 'An analysis of crowds,  publics,  social movements and the mass society in terms of their institutional and social psychological consequences.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B355', 'Minority Group Relations', 'UG', 3, 'Theories,  methods and substantive issues in the study of majority-minority group relations and social processes and cultural orientations associated with racial and ethnic differentiation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B356', 'Sociology of the Body', 'UG', 3, 'Interdisciplinary exploration of the body as a social construction,  a site of contested terrain acted on by others and by the self,  and a location of struggle,  pleasure,  loss,  politics.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B357', 'Sociology of Education', 'UG', 3, '{=BEFN 357}  Analysis of educational institutions,  organizations,  processes and their effects in contemporary society.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B360', 'Sociology of Medicine and Health', 'UG', 3, 'Social factors in health,  illness and medicine in contemporary society.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B362', 'Sociology of Disability', 'UG', 3, 'A social perspective is employed to analyze social disability. Several theoretical concepts provide students with the ability to understand social disability from a unique angle.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B370', 'Sociology of Sport', 'UG', 3, 'Theories,  methods and substantive issues in the study of sport in contemporary societies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B398', 'Topics in Sociology', 'UG', 3, 'Reading and research on selected sociological topics. Course content varies and will be announced in the schedule of classes by suffix and title.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SOCY', 'B399', 'Independent Study in Sociology', 'UG', 3, 'Contract approval by instructor,  advisor,  Department Chair and Executive Vice Chancellor for Academic Affairs is required.');
