INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B312', 'Introduction to Reading Hispanic Literary Text', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 309,  or consent of instructor. Department permission required for transfer students.) Approaches to reading literary texts through carefully selected readings from different genres. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B316', 'Business Spanish', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 309,  or consent of instructor. Department permission required for transfer students.) Commercial organizations and business in Spanish-speaking countries,  business correspondence,  terminology and techniques in commercial transactions. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B350', 'Spanish Language Study Abroad', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210,  or consent of instructor. Department permission required for transfer students.) Intensive language practice in native environment with emphasis on oral skills. Instruction by native speakers; community contact and home stay. Prior placement test required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B375', 'Topics in Hispanic Cultures and Literatures', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210 or consent of instructor. Department permission required for transfer students.) Course content varies and will be announced in the schedule of classes by suffix and title. May be repeated once for credit. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B380', 'Hispanic Film and Culture', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 309,  or consent of instructor. Department permission required for transfer students.) Interpretation of contemporary Hispanic culture through selected Spanish or Spanish-American films. A: Spanish film; B: Spanish-American film. Taught in Spanish. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B398', 'Selected Topics in Spanish', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210,  or consent of instructor. Department permission required for transfer students.) Intensive study of selected topics of the Hispanic world. May be repeated for credit under different suffix. Taught in English.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B399', 'Independent Study in Spanish', 'UG', 3, 'SPAN B399 - INDEPENDENT STUDY (3-6). (Prereq: Placement at 300 [Level] on Phase II placement exam,  grade of B or better in BSPA 210,  or consent of instructor. Department permission required for transfer students.) Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for academic affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B400', 'Spanish Civilization', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210,  or consent of instructor.) Lectures,  readings and visuals on Spanish civilization and its cultural heritage from the Middle Ages to 1700. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B401', 'Spanish American Civilization I', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210,  or consent of instructor.) Lectures,  readings and visuals on Spanish American civilization and its cultural heritage from the Pre-Columbian Era to Independence. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B402', 'Spanish Civilization II', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210,  or consent of instructor.) Lectures,  readings and visuals on Spanish civilization and its cultural heritage from the 18th century to the present day. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B403', 'Spanish American Civilization II', 'UG', 3, 'BSPA 403 - SPANISH AMERICAN CIVILIZATION II (3). (Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in BSPA 210,  or consent of instructor.) Lectures,  readings and visuals on Spanish American civilization and its cultural heritage from Independence to the present day. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B404', 'Literary Tendencies and Masterpieces of Spain I', 'UG', 3, '(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the Middle Ages to the 17th century. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B405', 'Literary Tendencies and Masterpieces of Spanish America I', 'UG', 3, '(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from the Pre-Columbian Era to Independence. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B406', 'Literary Tendencies and Masterpieces of Spain II', 'UG', 3, '(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the 18th century to present day. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B407', 'Literary Tendencies and Masterpieces of Spanish America II', 'UG', 3, '(Prereq: BSPA 312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from Independence to present day. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B417', 'Advanced Spanish for Business and The Professions', 'UG', 3, '(Prereq: BSPA 316 or consent of instructor) Vocabulary,  concepts and oral/written skills necessary to communicate effectively in the social,  cultural,  or economic infrastructure of Hispanic countries. Introduction to the use of technology for the acquisition and processing of materials relevant to students professional goals. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('SPAN', 'B499', 'Senior Seminar in Spanish', 'UG', 3, '(Prerequisite: Placement at 300 [Level] on Phase II placement exam,  grade of C or better in at least one cultural history course (BSPA 400,  401,  402 or 403) and in at least one literature course (BSPA 404,  405,  406,  or 407),  or consent of instructor) A special seminar devoted to the in-depth study of selected subjects in Hispanic literature,  culture,  or language. Required for the intensive major in Spanish. Taught in Spanish.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('STAT', 'B110', 'Introduction to Descriptive Statistics', 'UG', 3, 'Computational and graphical techniques for organizing and presenting statistical data. Sample mean and sample variance,  cross tabulation of categorical data,  correlation and simple linear regression,  quality control charts,  statistical software.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('STAT', 'B201', 'Elementary Statistics', 'UG', 3, '(Prereq: MATH B101 or higher or consent of instructor) An introductory course in the fundamentals of modern statistical methods. Topics include descriptive statistics,  normal distributions,  random sampling,  statistical studies and ethics,  probability,  confidence intervals,  tests of hypothesis,  simple linear regression and correlation.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('STAT', 'B202', 'Elementary Statistics Laboratory', 'UG', NULL, '(Prereq: or Coreq: STAT B201) Experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('STAT', 'B210', 'Elementary Statistics II', 'UG', NULL, 'A second course in statistics for students requiring knowledge of advanced procedures for descriptive and inferential statistics.  Topics include assessing normality,  modeling nonlinear data,  conditions and assumptions for inference,  and application of multiple inference techniques.  Other topics chosen from: statistical quality control,  random variables,  binomial and geometric distributions,  sampling and simulation,  and non-parametric tests.  Prerequisite: STAT B201 or consent');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('STAT', 'B240', 'Fundamentals of Probability & Statistics', 'UG', 3, '(Prerequisite: MATH B141) Categorical and quantitative data; marginal and conditional distributions; normal model; association and correlation; linear regression; randomness and probability; sampling distribution models; confidence intervals and hypothesis tests; two-sample z-Test; two=sample t-Test; the paired t-Test.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('STAT', 'B340', 'Introduction to Probabilty and Statistics', 'UG', 3, '(Prereq: MATH B240 or consent.) Set theory; distributions of both discrete and continuous random variables; moments (including moment generating and characteristic functions); limit theorems; multivariate distributions including marginal and conditional distributions; confidence intervals and hypothesis tests.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B170', 'Fundamentals of Acting', 'UG', 3, 'The techniques of body and voice control; improvisations; interpretation of characters: characterization applied in scenes.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B200', 'Understanding and Appreciation of Theatre', 'UG', 3, 'An introduction to the understanding and appreciation of theatrical experience. Attendance at theatrical performances required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B201', 'Introduction to Script Analysis', 'UG', 3, 'In this course,  students will apply research and analysis skills to dramatic texts with an eye toward serving theatrical productions.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B220', 'Theatre Laboratory', 'UG', 1, 'Prerequisite: Instructor Consent) Supervised participation in theatre production. No formal class meetings. May be repeated for up to 8 credits. Course may not be used to fulfill GE requirement.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B301', 'Theater History I', 'UG', 3, 'A study of the development of Western theatrical pratices including playwriting,  acting,  and design from ancient Greece to 1800.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B302', 'Theatre History II', 'UG', 3, 'A study of the development of Western theatrical texts and practices including playwriting,  acting,  directing,  and design from 1800 to the present');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B303', 'Asian Theaters', 'UG', 3, 'A survey of the theatrical genres and practices of Japan,  China,  Indonesia,  and India.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B310', 'Reading and Performing Shakespeare', 'UG', 3, '(Prereq: ENGL B101 or B105,  and ENGL B102 or B106,  each with a C or higher) A course about how people read and perform Shakespeare in which students read and perform Shakespeare.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B322', 'Playwriting', 'UG', 3, 'A workshop approach to playwriting that culminates in each student creating a production-ready one-act play.');
GO
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B333', 'Directing', 'UG', 3, '(Prerequisite: THEA B170) An introduction to the history,  principles,  and practices of the art of stage direction including the selection,  casting,  and rehearsing of scenes to be presented in class.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B340', 'Oral Interpretation of Literature', 'UG', 3, '{=SPCH B340}  A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B341', 'Performance of Caring', 'UG', 3, '{NURS B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic,  realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B370', 'Intermediate Acting', 'UG', 3, 'A continuation of THEA B170.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B382', 'Theater for Young Audiences', 'UG', 3, '(Prerequisite: THEA B170 or instructor permission) Methods for creating theater for youth. A children''s play will be produced and performed.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B399', 'Independent Study in Theatre', 'UG', 3, 'Contract approval by instructor,  advisor,  Department Chair and Vice Chancellor for Academic Affairs is required.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B410', 'Introduction to Performance Studies', 'UG', 3, 'An introduction to the field of performance studies including a history of the field,  theories of performance,  and a broad look at the different behaviors and cultural artifacts performance studies scholars examine.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B430', 'Performing Shakespeare', 'UG', 3, 'This class helps students develop a mastery of methods that enable one to perform the works of Shakespeare with confidence and competence.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B439', 'Topics in Theater & Performance', 'UG', 3, '(Prerequisite: Sophomore Standing) Intensive study of selected practices,  topics,  currents of thought or interdisciplinary concerns. May be repeated for credit under a different topic.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B466', 'Theater Internship', 'UG', NULL, 'This course provides a structured but flexible opportunity for students to earn course credit for an internship with a professional,  community,  or educational theater organization outside the university.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B472', 'Cinema', 'UG', 3, '{=ENGL B472}  (Prereq: ENGL B101 and ENGL B102) An investigation the aesthetics of cinema. This course will also focus on the major genres.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B472L', 'Cinema Laboratory', 'UG', 1, '{=ENGL B472L}  Required viewing for THEA B472.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('THEA', 'B481', 'History of Cinema', 'UG', NULL, 'Survey of the international cinema from 1945 to the present.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B101', 'Student in the University', 'UG', 3, 'The purposes of higher education and potential roles of the student within the university. Open to freshmen. Also open to other undergraduate students in their first semester of enrollment.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B102', 'Well-Being in the University', 'UG', 1, 'Well-Being in the University is designed to help first-year students who had experienced academic difficulties in their first semester better understand how their overall well-being impacts their success in college. Using a strengths-based approach,  this course provides a general overview of the dimensions of wellness,  helps students explore how their overall well-being effects their college success,  and how they can use their strengths to overcome barriers to success in college.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B150', 'Exploration of Nursing and Health Professions', 'UG', 1, 'An exploration of health professions as a major and career,  including the academic and vocational requirements as well as alternative majors in the health professions and other fields. This course will include exploration of majors,  self-assessment,  occupational information,  and values clarification.  Prerequisite: Placement MATH B111E and ENGL B101L');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B200', 'Lowcountry Studies Honors Seminar', 'UG', 1, 'This seminar will an introduction to topics,  information,  reading,  and class field trips to reflect the Lowcountry Studies honor''s experience in the first year of the program.  Topics covered will include common readings,  discussion of current topics or current events,  and professional development of the student.  Course can be taken for credit up to two semesters.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B250', 'Career and Life Planning', 'UG', 1, 'This course will aid in development of career and life-planning skills through exposure to self-assessment,  occupational information,  job search techniques,  professional literature,  experiential education,  values clarification,  and career ladder strategies.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B401', 'Graduation with Leadership Distinction Captstone', 'UG', 1, '(Prerequisite: Junior or Senior Standing) Integration of a student''s program of study and "Students Connected" coursework. Course includes portfolio development,  professional presentation,  and transition graduate school and/or employment.');
INSERT [dbo].[CourseCatalog] ([SubjectID], [CourseNum], [CourseTitle], [Level], [CreditHours], [CourseDesc]) VALUES
 ('UNIV', 'B491', 'Leadership in Practice', 'UG', 1, 'This course explores the practice of leadership and engages outstanding students in an active dialogue about the challenges of being a leader within the university context and beyond.');
